}

.cm-s-retro .cm-string {
    color: #ffcc00 !important; /* Yellow for strings */
}

.cm-s-retro .cm-number {
    color: #33cc33 !important; /* Green for numbers */
}

.cm-s-retro .cm-keyword {
    color: #ff00ff !important; /* Magenta for keywords */
    font-weight: bold; /* Bold for emphasis */
}

.cm-s-retro .cm-operator {
    color: #fff !important; /* White for operators */
}

.cm-s-retro .cm-variable {
    color: #00ff00 !important; /* Green for variables */
}

.cm-s-retro .cm-variable-2 {
    color: #33cc33 !important; /* Lighter green for secondary variables */
}

.cm-s-retro .cm-def {
    color: #ff00ff !important; /* Magenta for definitions */
}

.cm-s-retro .cm-property {
    color: #ffcc00 !important; /* Yellow for properties */
}

.cm-s-retro .cm-function {
    color: #ff00ff !important; /* Magenta for functions */
}

.cm-s-retro .cm-builtin {
    color: #33cc33 !important; /* Green for built-ins */
}

.cm-s-retro .cm-tag {
    color: #ff3333 !important; /* Red for tags (if HTML mode is used) */
}

.cm-s-retro .cm-attribute {
    color: #ffcc00 !important; /* Yellow for attributes */
}

/* Matching Brackets */
.cm-s-retro .CodeMirror-matchingbracket {
    color: #33cc33 !important; /* Green for matching brackets */
    border-bottom: 2px solid #33cc33 !important;
    background: none !important;
}

.cm-s-retro .CodeMirror-nonmatchingbracket {
    color: #ff3333 !important; /* Red for non-matching brackets */
    border-bottom: 2px solid #ff3333 !important;
}

/* Autocomplete Hints */
.CodeMirror-hints {
    background: #2b2b2b !important; /* Dark retro gray */
    border: 2px solid #fff !important; /* White border */
    color: #fff !important;
    font-family: 'Press Start 2P', cursive !important;
    font-size: 10px !important;
    box-shadow: 4px 4px 0 #000; /* Retro shadow effect */
}

.CodeMirror-hints .CodeMirror-hint {
    color: #ffcc00 !important; /* Yellow for hint items */
    padding: 5px !important;
}

.CodeMirror-hints .CodeMirror-hint-active {
    background: #ff3333 !important; /* Red for selected hint */
    color: #000 !important;
}

/* Scrollbars (minimal retro style) */
.CodeMirror-vscrollbar, .CodeMirror-hscrollbar {
    background: #3c3c3c !important;
}

.CodeMirror-scrollbar-filler {
    background: #000 !important;
}

/* Animations */
@keyframes blink {
    50% { opacity: 0; }
}

InstancePool.script:
class InstancePool {
    constructor(geometry, material, initialSize) {
        this.mesh = new THREE.InstancedMesh(geometry, material, initialSize);
        this.mesh.count = 0;
        this.freeIndices = [];
        this.maxIndex = 0;
    }

    addInstance(matrix) {
        let index;
        if (this.freeIndices.length > 0) {
            index = this.freeIndices.pop();
        } else {
            index = this.maxIndex++;
            if (index >= this.mesh.instanceMatrix.count) {
                this.expandPool(Math.max(this.mesh.count * 2, 100));
            }
        }

        this.mesh.setMatrixAt(index, matrix);
        this.mesh.count = Math.max(this.mesh.count, index + 1);
        this.mesh.instanceMatrix.needsUpdate = true;
        return index;
    }

    removeInstance(index) {
        this.freeIndices.push(index);
        // Set identity matrix to hide instance
        this.mesh.setMatrixAt(index, new THREE.Matrix4());
        this.mesh.instanceMatrix.needsUpdate = true;
    }

    expandPool(additionalSize) {
        const newCount = this.mesh.instanceMatrix.count + additionalSize;
        const newMesh = new THREE.InstancedMesh(
            this.mesh.geometry,
            this.mesh.material,
            newCount
        );
        
        newMesh.instanceMatrix.copy(this.mesh.instanceMatrix);
        newMesh.count = this.mesh.count;
        this.mesh.dispose();
        this.mesh = newMesh;
    }
}

SE_GizmoManager.script:
class SE_GizmoManager {
    constructor() {}

    init(sceneEditor){        
        this.sceneEditor = sceneEditor; // Store reference to the scene editor
        this.scene = sceneEditor.scene;
        this.camera = sceneEditor.camera;
        this.renderer = sceneEditor.renderer;
        this.controls = sceneEditor.controls;
        
        this.gizmoGroup = new THREE.Group();
        this.gizmoGroup.name = "transformGizmo";
        this.scene.add(this.gizmoGroup);
        
        this.mode = 'translate'; // 'translate', 'rotate', 'scale'
        this.selectedAxis = null;
        this.isDragging = false;
        this.targetObject = null;
        this.startPosition = new THREE.Vector3();
        this.startRotation = new THREE.Euler();
        this.startScale = new THREE.Vector3();
        this.dragStartPoint = new THREE.Vector3();
        this.dragCurrentPoint = new THREE.Vector3();
        
        this.raycaster = new THREE.Raycaster();
        this.mouse = new THREE.Vector2();
        
        this.axisColors = {
            x: 0xff0000, // red
            y: 0x00ff00, // green
            z: 0x0000ff  // blue
        };
        
        this.highlightColor = 0xffff00; // yellow for highlighting
        
        this.initializeGizmos();
        this.setupEventListeners();
    }
    
    initializeGizmos() {
        this.translateGizmo = this.createTranslateGizmo();
        this.rotateGizmo = this.createRotateGizmo();
        this.scaleGizmo = this.createScaleGizmo();
        
        this.gizmoGroup.add(this.translateGizmo);
        this.gizmoGroup.add(this.rotateGizmo);
        this.gizmoGroup.add(this.scaleGizmo);
        
        // Initially hide all gizmos
        this.gizmoGroup.visible = false;
        this.translateGizmo.visible = false;
        this.rotateGizmo.visible = false;
        this.scaleGizmo.visible = false;
    }
    
    createTranslateGizmo() {
        const group = new THREE.Group();
        group.name = "translateGizmo";
        
        // Create axis arrows
        const arrowLength = 2;
        const arrowHeadLength = .5;
        const arrowHeadWidth = .5;
        
        // X axis (red)
        const xArrow = new THREE.ArrowHelper(
            new THREE.Vector3(1, 0, 0),
            new THREE.Vector3(0, 0, 0),
            arrowLength,
            this.axisColors.x,
            arrowHeadLength,
            arrowHeadWidth
        );
        xArrow.name = "translateX";
        xArrow.line.material.linewidth = 3;
        xArrow.line.material.depthTest = false;
        xArrow.line.material.transparent = true;
        xArrow.line.material.opacity = 0.6;
        xArrow.cone.material.depthTest = false;
        xArrow.cone.material.transparent = true;
        xArrow.cone.material.opacity = 0.6;
        // Make arrow cone and line both interactive
        xArrow.cone.userData.axis = 'x';
        xArrow.cone.userData.gizmoType = 'translate';
        xArrow.line.userData.axis = 'x';
        xArrow.line.userData.gizmoType = 'translate';
        
        // Y axis (green)
        const yArrow = new THREE.ArrowHelper(
            new THREE.Vector3(0, 1, 0),
            new THREE.Vector3(0, 0, 0),
            arrowLength,
            this.axisColors.y,
            arrowHeadLength,
            arrowHeadWidth
        );
        yArrow.name = "translateY";
        yArrow.line.material.linewidth = 3;
        yArrow.line.material.depthTest = false;
        yArrow.line.material.transparent = true;
        yArrow.line.material.opacity = 0.6;
        yArrow.cone.material.depthTest = false;
        yArrow.cone.material.transparent = true;
        yArrow.cone.material.opacity = 0.6;
        // Make arrow cone and line both interactive
        yArrow.cone.userData.axis = 'y';
        yArrow.cone.userData.gizmoType = 'translate';
        yArrow.line.userData.axis = 'y';
        yArrow.line.userData.gizmoType = 'translate';
        
        // Z axis (blue)
        const zArrow = new THREE.ArrowHelper(
            new THREE.Vector3(0, 0, 1),
            new THREE.Vector3(0, 0, 0),
            arrowLength,
            this.axisColors.z,
            arrowHeadLength,
            arrowHeadWidth
        );
        zArrow.name = "translateZ";
        zArrow.line.material.linewidth = 3;
        zArrow.line.material.depthTest = false;
        zArrow.line.material.transparent = true;
        zArrow.line.material.opacity = 0.6;
        zArrow.cone.material.depthTest = false;
        zArrow.cone.material.transparent = true;
        zArrow.cone.material.opacity = 0.6;
        // Make arrow cone and line both interactive
        zArrow.cone.userData.axis = 'z';
        zArrow.cone.userData.gizmoType = 'translate';
        zArrow.line.userData.axis = 'z';
        zArrow.line.userData.gizmoType = 'translate';
        
        group.add(xArrow);
        group.add(yArrow);
        group.add(zArrow);
        
        return group;
    }
    
    createRotateGizmo() {
        const group = new THREE.Group();
        group.name = "rotateGizmo";
        
        const radius = 1;
        const tube = 0.05; // Increased tube size for better visibility and interaction
        const radialSegments = 24;
        const tubularSegments = 48;
        
        // X axis ring (red)
        const xGeometry = new THREE.TorusGeometry(radius, tube, radialSegments, tubularSegments);
        const xMaterial = new THREE.MeshBasicMaterial({ color: this.axisColors.x, transparent: true, opacity: 0.6, depthTest: false });
        const xRing = new THREE.Mesh(xGeometry, xMaterial);
        xRing.name = "rotateX";
        xRing.rotation.y = Math.PI / 2;
        xRing.userData.axis = 'x';
        xRing.userData.gizmoType = 'rotate';
        
        // Y axis ring (green)
        const yGeometry = new THREE.TorusGeometry(radius, tube, radialSegments, tubularSegments);
        const yMaterial = new THREE.MeshBasicMaterial({ color: this.axisColors.y, transparent: true, opacity: 0.6, depthTest: false });
        const yRing = new THREE.Mesh(yGeometry, yMaterial);
        yRing.name = "rotateY";
        yRing.rotation.x = Math.PI / 2; // Fixed rotation axis
        yRing.userData.axis = 'y';
        yRing.userData.gizmoType = 'rotate';
        
        // Z axis ring (blue)
        const zGeometry = new THREE.TorusGeometry(radius, tube, radialSegments, tubularSegments);
        const zMaterial = new THREE.MeshBasicMaterial({ color: this.axisColors.z, transparent: true, opacity: 0.6, depthTest: false });
        const zRing = new THREE.Mesh(zGeometry, zMaterial);
        zRing.name = "rotateZ";
        zRing.userData.axis = 'z';
        zRing.userData.gizmoType = 'rotate';
        
        group.add(xRing);
        group.add(yRing);
        group.add(zRing);
        
        return group;
    }
    
    createScaleGizmo() {
        const group = new THREE.Group();
        group.name = "scaleGizmo";
        
        const lineLength = 1.5; // Increased for better visibility
        const boxSize = 0.2;    // Increased for better interaction
        
        // X axis (red)
        const xLine = new THREE.Line(
            new THREE.BufferGeometry().setFromPoints([
                new THREE.Vector3(0, 0, 0),
                new THREE.Vector3(lineLength, 0, 0)
            ]),
            new THREE.LineBasicMaterial({ color: this.axisColors.x, transparent: true, opacity: 0.6, depthTest: false, linewidth: 2 })
        );
        xLine.userData.axis = 'x';
        xLine.userData.gizmoType = 'scale';
        
        const xBox = new THREE.Mesh(
            new THREE.BoxGeometry(boxSize, boxSize, boxSize),
            new THREE.MeshBasicMaterial({ color: this.axisColors.x, transparent: true, opacity: 0.6, depthTest: false })
        );
        xBox.position.set(lineLength, 0, 0);
        xBox.name = "scaleX";
        xBox.userData.axis = 'x';
        xBox.userData.gizmoType = 'scale';
        
        // Y axis (green)
        const yLine = new THREE.Line(
            new THREE.BufferGeometry().setFromPoints([
                new THREE.Vector3(0, 0, 0),
                new THREE.Vector3(0, lineLength, 0)
            ]),
            new THREE.LineBasicMaterial({ color: this.axisColors.y, transparent: true, opacity: 0.6, depthTest: false, linewidth: 2 })
        );
        yLine.userData.axis = 'y';
        yLine.userData.gizmoType = 'scale';
        
        const yBox = new THREE.Mesh(
            new THREE.BoxGeometry(boxSize, boxSize, boxSize),
            new THREE.MeshBasicMaterial({ color: this.axisColors.y, transparent: true, opacity: 0.6,  depthTest: false })
        );
        yBox.position.set(0, lineLength, 0);
        yBox.name = "scaleY";
        yBox.userData.axis = 'y';
        yBox.userData.gizmoType = 'scale';
        
        // Z axis (blue)
        const zLine = new THREE.Line(
            new THREE.BufferGeometry().setFromPoints([
                new THREE.Vector3(0, 0, 0),
                new THREE.Vector3(0, 0, lineLength)
            ]),
            new THREE.LineBasicMaterial({ color: this.axisColors.z, transparent: true, opacity: 0.6, depthTest: false, linewidth: 2 })
        );
        zLine.userData.axis = 'z';
        zLine.userData.gizmoType = 'scale';
        
        const zBox = new THREE.Mesh(
            new THREE.BoxGeometry(boxSize, boxSize, boxSize),
            new THREE.MeshBasicMaterial({ color: this.axisColors.z, transparent: true, opacity: 0.6, depthTest: false })
        );
        zBox.position.set(0, 0, lineLength);
        zBox.name = "scaleZ";
        zBox.userData.axis = 'z';
        zBox.userData.gizmoType = 'scale';
        
        // Uniform scale handle (white)
        const uniformBox = new THREE.Mesh(
            new THREE.BoxGeometry(boxSize * 1.5, boxSize * 1.5, boxSize * 1.5),
            new THREE.MeshBasicMaterial({ color: 0xffffff, transparent: true, opacity: 0.6,  depthTest: false })
        );
        uniformBox.position.set(0, 0, 0);
        uniformBox.name = "scaleXYZ";
        uniformBox.userData.axis = 'xyz';
        uniformBox.userData.gizmoType = 'scale';
        
        group.add(xLine);
        group.add(xBox);
        group.add(yLine);
        group.add(yBox);
        group.add(zLine);
        group.add(zBox);
        group.add(uniformBox);
        
        return group;
    }
    
    setupEventListeners() {
        const canvas = this.renderer.domElement;
        
        canvas.addEventListener('mousemove', this.onMouseMove.bind(this), false);
        canvas.addEventListener('mousedown', this.onMouseDown.bind(this), false);
        canvas.addEventListener('mouseup', this.onMouseUp.bind(this), false);
        
        // Add keyboard shortcuts for switching transform modes
        document.addEventListener('keydown', (event) => {
            if (!this.targetObject) return;
            
            switch (event.key.toLowerCase()) {
                case 'g':
                    this.setMode('translate');
                    break;
                case 'r':
                    this.setMode('rotate');
                    break;
                case 's':
                    this.setMode('scale');
                    break;
            }
        }, false);
    }
    
    onMouseMove(event) {
        // Update mouse position
        const canvas = this.renderer.domElement;
        const rect = canvas.getBoundingClientRect();
        
        this.mouse.x = ((event.clientX - rect.left) / canvas.clientWidth) * 2 - 1;
        this.mouse.y = -((event.clientY - rect.top) / canvas.clientHeight) * 2 + 1;
        
        if (!this.targetObject) return;
        
        if (this.isDragging) {
            this.handleDrag();
        } else {
            this.highlightGizmo();
        }
    }
    
    onMouseDown(event) {
        if (!this.targetObject) return;
        
        const intersectedAxis = this.getIntersectedGizmo();
        if (!intersectedAxis) return;
        
        this.isDragging = true;
        this.selectedAxis = intersectedAxis;
        
        // Store starting position for reference during drag
        this.startPosition.copy(this.targetObject.position);
        this.startRotation.copy(this.targetObject.rotation);
        this.startScale.copy(this.targetObject.scale);
        
        // Disable camera controls during drag
        this.controls.enabled = false;
        
        // Reset drag points for reference
        this.dragStartPoint = this.getPointOnDragPlane();
        
        // Log for debugging
        console.log(`Started dragging ${this.mode} gizmo on axis: ${this.selectedAxis}`);
    }
    
    onMouseUp() {
        if (this.isDragging) {
            this.isDragging = false;
            
            // Re-enable camera controls
            this.controls.enabled = true;
            
            // Update entity data in the SceneEditor
            if (this.targetObject && this.sceneEditor.state.selectedEntity) {
                const entity = this.sceneEditor.state.selectedEntity;
                const transformComponent = entity.components.find(c => c.type === 'transform');
                
                if (transformComponent) {
                    const position = this.targetObject.position;
                    const rotation = this.targetObject.rotation;
                    const scale = this.targetObject.scale;
                    
                    // Update the entity data
                    transformComponent.parameters.position = { x: position.x, y: position.y, z: position.z };
                    transformComponent.parameters.rotation = { x: rotation.x, y: rotation.y, z: rotation.z };
                    transformComponent.parameters.scale = { x: scale.x, y: scale.y, z: scale.z };
                    
                    // Trigger save to update the UI
                    this.sceneEditor.handleSave(false);
                    this.sceneEditor.renderInspector();
                    
                    // Log for debugging
                    console.log(`Updated entity transform:`, {
                        position: transformComponent.parameters.position,
                        rotation: transformComponent.parameters.rotation,
                        scale: transformComponent.parameters.scale
                    });
                }
            }
            
            this.selectedAxis = null;
        }
    }
    
    getIntersectedGizmo() {
        if (!this.gizmoGroup.visible) return null;
        
        this.raycaster.setFromCamera(this.mouse, this.camera);
        
        let activeGizmo;
        switch (this.mode) {
            case 'translate':
                activeGizmo = this.translateGizmo;
                break;
            case 'rotate':
                activeGizmo = this.rotateGizmo;
                break;
            case 'scale':
                activeGizmo = this.scaleGizmo;
                break;
        }
        
        // Get all intersections with the active gizmo and its children
        const intersects = this.raycaster.intersectObject(activeGizmo, true);
        
        if (intersects.length > 0) {
            // The first intersection is the closest one
            const object = intersects[0].object;
            
            // Return the axis from the userData
            if (object.userData.axis) {
                return object.userData.axis;
            }
            
            // Legacy support for objects without userData
            if (object.name.startsWith('translate')) {
                return object.name.charAt(object.name.length - 1).toLowerCase();
            } else if (object.name.startsWith('rotate')) {
                return object.name.charAt(object.name.length - 1).toLowerCase();
            } else if (object.name.startsWith('scale')) {
                return object.name.substring(5).toLowerCase();
            }
            
            // For debugging
            console.log("Intersected object:", object);
        }
        
        return null;
    }
    
    highlightGizmo() {
        const axis = this.getIntersectedGizmo();
        
        // Reset all gizmos to their original colors
        this.resetGizmoColors();
        
        // Highlight the intersected axis
        if (axis) {
            this.highlightAxis(axis);
        }
    }
    
    resetGizmoColors() {
        // Reset translate gizmo colors
        this.translateGizmo.traverse((object) => {
            if (object.userData.gizmoType === 'translate') {
                if (object.isMesh || object.type === 'Mesh') {
                    object.material.color.setHex(this.axisColors[object.userData.axis] || 0xffffff);
                } else if (object.isLine || object.type === 'Line') {
                    object.material.color.setHex(this.axisColors[object.userData.axis] || 0xffffff);
                } else if (object.type === 'ArrowHelper') {
                    if (object.line) object.line.material.color.setHex(this.axisColors[object.userData.axis] || 0xffffff);
                    if (object.cone) object.cone.material.color.setHex(this.axisColors[object.userData.axis] || 0xffffff);
                }
            }
        });
        
        // Reset rotate gizmo colors
        this.rotateGizmo.traverse((object) => {
            if (object.userData.gizmoType === 'rotate' && object.material) {
                object.material.color.setHex(this.axisColors[object.userData.axis] || 0xffffff);
            }
        });
        
        // Reset scale gizmo colors
        this.scaleGizmo.traverse((object) => {
            if (object.userData.gizmoType === 'scale' && object.material) {
                if (object.userData.axis === 'xyz') {
                    object.material.color.setHex(0xffffff);
                } else {
                    object.material.color.setHex(this.axisColors[object.userData.axis] || 0xffffff);
                }
            }
        });
    }
    
    highlightAxis(axis) {
        const highlightColor = this.highlightColor;
        
        switch (this.mode) {
            case 'translate':
                this.translateGizmo.traverse((object) => {
                    if (object.userData.gizmoType === 'translate' && object.userData.axis === axis) {
                        if (object.isMesh || object.type === 'Mesh') {
                            object.material.color.setHex(highlightColor);
                        } else if (object.isLine || object.type === 'Line') {
                            object.material.color.setHex(highlightColor);
                        } else if (object.type === 'ArrowHelper') {
                            if (object.line) object.line.material.color.setHex(highlightColor);
                            if (object.cone) object.cone.material.color.setHex(highlightColor);
                        }
                    }
                });
                break;
                
            case 'rotate':
                this.rotateGizmo.traverse((object) => {
                    if (object.userData.gizmoType === 'rotate' && object.userData.axis === axis && object.material) {
                        object.material.color.setHex(highlightColor);
                    }
                });
                break;
                
            case 'scale':
                this.scaleGizmo.traverse((object) => {
                    if (object.userData.gizmoType === 'scale' && 
                        (object.userData.axis === axis || (axis === 'xyz' && object.userData.axis === 'xyz')) && 
                        object.material) {
                        object.material.color.setHex(highlightColor);
                    }
                });
                break;
        }
    }
    
    getPointOnDragPlane() {
        // Create a plane based on the camera view and selected axis
        const cameraDirection = new THREE.Vector3();
        this.camera.getWorldDirection(cameraDirection);
        
        let planeNormal;
        
        // Set plane normal based on selected axis and camera direction
        if (this.selectedAxis === 'x') {
            planeNormal = new THREE.Vector3(0, 1, 0);
            if (Math.abs(cameraDirection.dot(planeNormal)) < 0.2) {
                planeNormal.set(0, 0, 1);
            }
        } else if (this.selectedAxis === 'y') {
            planeNormal = new THREE.Vector3(1, 0, 0);
            if (Math.abs(cameraDirection.dot(planeNormal)) < 0.2) {
                planeNormal.set(0, 0, 1);
            }
        } else if (this.selectedAxis === 'z') {
            planeNormal = new THREE.Vector3(1, 0, 0);
            if (Math.abs(cameraDirection.dot(planeNormal)) < 0.2) {
                planeNormal.set(0, 1, 0);
            }
        } else if (this.selectedAxis === 'xyz') {
            planeNormal = cameraDirection;
        }
        
        // Create drag plane
        const plane = new THREE.Plane(planeNormal, -this.targetObject.position.dot(planeNormal));
        
        // Cast ray from mouse and get intersection point with the plane
        this.raycaster.setFromCamera(this.mouse, this.camera);
        
        const intersectionPoint = new THREE.Vector3();
        const didIntersect = this.raycaster.ray.intersectPlane(plane, intersectionPoint);
        
        if (!didIntersect) {
            console.warn("Failed to intersect with drag plane");
            // Return a fallback point to prevent errors
            return this.targetObject.position.clone();
        }
        
        return intersectionPoint;
    }
    
    handleDrag() {
        if (!this.selectedAxis) return;
        
        // Get current point on drag plane
        this.dragCurrentPoint = this.getPointOnDragPlane();
        
        // Calculate delta movement
        const delta = new THREE.Vector3().subVectors(this.dragCurrentPoint, this.dragStartPoint);
        
        switch (this.mode) {
            case 'translate':
                this.handleTranslation(delta);
                break;
            case 'rotate':
                this.handleRotation(delta);
                break;
            case 'scale':
                this.handleScaling(delta);
                break;
        }
        
        // Update gizmo position to match target object
        this.updateGizmoTransform();
        
        // Update the drag start point to prevent accumulation of tiny movements
        this.dragStartPoint = this.dragCurrentPoint;
    }
    
    handleTranslation(delta) {
        // Restrict movement to the selected axis
        let moveVector = new THREE.Vector3();
        
        if (this.selectedAxis === 'x') {
            moveVector.x = delta.x;
        } else if (this.selectedAxis === 'y') {
            moveVector.y = delta.y;
        } else if (this.selectedAxis === 'z') {
            moveVector.z = delta.z;
        } else if (this.selectedAxis === 'xyz') {
            // Allow movement in all directions for xyz
            moveVector.copy(delta);
        }
        
        // Apply the translation
        this.targetObject.position.add(moveVector);
    }
    
    handleRotation(delta) {
        if (!this.targetObject) return;
        
        // Calculate rotation angle based on mouse movement
        const rotationSpeed = 2.0;
        let angle = 0;
        
        // Calculate angle based on the delta movement and distance from center
        switch (this.selectedAxis) {
            case 'x':
                angle = delta.y * rotationSpeed;
                this.targetObject.rotation.x += angle;
                break;
            case 'y':
                angle = delta.x * rotationSpeed;
                this.targetObject.rotation.y += angle;
                break;
            case 'z':
                angle = (delta.x + delta.y) * rotationSpeed;
                this.targetObject.rotation.z += angle;
                break;
            case 'xyz':
                // For free rotation, we would need quaternions and would be more complex
                break;
        }
    }
    
    handleScaling(delta) {
        if (!this.targetObject) return;
        
        // Calculate scaling factor based on mouse movement
        // Use the dot product of delta and direction from object to camera to determine increase/decrease
        const cameraDelta = new THREE.Vector3().subVectors(this.camera.position, this.targetObject.position).normalize();
        const scaleDirection = Math.sign(delta.dot(cameraDelta));
        
        // Adjust scaling sensitivity
        const scaleFactor = 1 + delta.length() * scaleDirection * 0.1;
        
        // Apply scale based on selected axis
        if (this.selectedAxis === 'xyz') {
            // Uniform scaling
            this.targetObject.scale.multiplyScalar(scaleFactor);
        } else {
            // Scale along specific axis
            if (this.selectedAxis === 'x') {
                this.targetObject.scale.x *= scaleFactor;
            } else if (this.selectedAxis === 'y') {
                this.targetObject.scale.y *= scaleFactor;
            } else if (this.selectedAxis === 'z') {
                this.targetObject.scale.z *= scaleFactor;
            }
        }
    }
    
    attach(object) {
        if (!object) return;
        
        this.detach(); // Detach from previous object if any
        
        this.targetObject = object;
        this.updateGizmoTransform();
        
        // Show the active gizmo
        this.gizmoGroup.visible = true;
        this.setMode(this.mode);
        
        console.log("Attached gizmo to:", object.name);
    }
    
    detach() {
        if (this.isDragging) {
            this.onMouseUp(); // End any active drag operation
        }
        
        this.targetObject = null;
        this.gizmoGroup.visible = false;
        this.translateGizmo.visible = false;
        this.rotateGizmo.visible = false;
        this.scaleGizmo.visible = false;
    }
    
    setMode(mode) {
        this.mode = mode;
        
        // Hide all gizmos
        this.translateGizmo.visible = false;
        this.rotateGizmo.visible = false;
        this.scaleGizmo.visible = false;
        
        // Show the selected gizmo
        switch (mode) {
            case 'translate':
                this.translateGizmo.visible = true;
                break;
            case 'rotate':
                this.rotateGizmo.visible = true;
                break;
            case 'scale':
                this.scaleGizmo.visible = true;
                break;
        }
        
        console.log(`Set gizmo mode: ${mode}`);
    }
    
    updateGizmoTransform() {
        if (!this.targetObject) return;
        
        // Update position to match target object
        this.gizmoGroup.position.copy(this.targetObject.position);
        
        // Calculate appropriate scale for the gizmo based on camera distance
        const distance = this.camera.position.distanceTo(this.gizmoGroup.position);
        const scale = distance / 20; // Adjusted for better visibility
        
        this.gizmoGroup.scale.set(scale, scale, scale);
    }
}

SceneEditor.script:
class SceneEditor {
    constructor(gameEditor, config, {ShapeFactory, SE_GizmoManager, ModelManager}) {
        this.gameEditor = gameEditor;
        this.config = config;
        this.scene = null;
        this.camera = null;
        this.renderer = null;
        this.controls = null;
        this.clock = new window.THREE.Clock();
        this.canvas = document.getElementById('scene-editor-canvas');
        
        this.state = {
            sceneData: [],
            selectedEntityIndex: -1,
            selectedEntity: null,
            selectedEntityObject: null
        };
        this.elements = {
            hierarchy: document.getElementById('scene-hierarchy'),
            inspector: document.getElementById('scene-inspector'),
            noSelection: document.getElementById('scene-noSelection'),
            entityInspector: document.getElementById('scene-entityInspector'),
            components: document.getElementById('scene-components'),
            addPrefabSelect: document.getElementById('scene-addPrefabSelect'),
            addPrefabBtn: document.getElementById('scene-addPrefabBtn'),
            removePrefabBtn: document.getElementById('scene-removePrefabBtn'),
        } 
        this.componentsToUpdate = [];
        this.shapeFactory = new ShapeFactory(this.gameEditor.getPalette(), this.gameEditor.getCollections().textures, null);
        if(location.hostname.indexOf('github') >= 0) {
            this.shapeFactory.setURLRoot("/GUTS/");
        }   
        this.gameEditor.modelManager = new ModelManager(this.gameEditor, {}, {ShapeFactory, palette: this.gameEditor.palette, textures: this.gameEditor.getCollections().textures});    
     
        this.nextEntityId = 1;
        this.initThreeJS(this.canvas);
        this.gizmoManager = new SE_GizmoManager();
        this.gizmoManager.init(this);
        this.initEventListeners();
        this.animate();
    }

    initEventListeners() {
        document.body.addEventListener('renderSceneObject', this.handleRenderSceneObject.bind(this));
        document.body.addEventListener('resizedEditor', () => { 
            this.canvas.width = this.gameEditor.getCollections().configs.game.canvasWidth;
            this.canvas.height = this.gameEditor.getCollections().configs.game.canvasHeight;
            this.canvas.setAttribute('style','');
            this.handleResize();  
            this.refreshScene(false); 
        });
        this.elements.addPrefabBtn.addEventListener('click', (e) => {
            let parts = this.elements.addPrefabSelect.value.split(".");
            const objType = parts[0];
            const spawnType = parts[1];
            const prefabData = this.gameEditor.getCollections()[objType][spawnType];
            if(prefabData.entity){
                this.createEntity(prefabData.entity, { "objectType": objType, "spawnType": spawnType, ...prefabData });
            }
        });
        this.elements.removePrefabBtn.addEventListener('click', () => {
            if (this.state.selectedEntity) {
                // Remove from Three.js scene
                const entityObject = this.state.selectedEntityObject || this.findEntityObject(this.state.selectedEntity);
                if (entityObject) {
                    this.shapeFactory.disposeObject(entityObject);
                    this.rootGroup.remove(entityObject);
                }
    
                // Remove from entities array
                const index = this.state.sceneData.indexOf(this.state.selectedEntity);
                if (index > -1) {
                    this.state.sceneData.splice(index, 1);
                }
    
                // Clear selection
                this.state.selectedEntity = null;
                this.state.selectedEntityObject = null;
                this.gizmoManager.detach();
    
                // Update UI
                this.handleSave(false);
                this.renderHierarchy();
                this.renderInspector();
            }
        });
        const collectionDefs = this.gameEditor.getCollectionDefs();
        let prefabTypes = [];
        for(let collectionDef of collectionDefs) {
            if(collectionDef.category.toLowerCase() == "prefabs") {
                prefabTypes.push(collectionDef.id);
            }
        }
        const collections = this.gameEditor.getCollections();
        for(let prefabTypeName of prefabTypes){
            let objectTypes = collections[prefabTypeName];
            for(let spawnTypeName in objectTypes){
                let spawnData = objectTypes[spawnTypeName];
                let option = document.createElement('option');
                option.innerText = spawnData.title;
                option.value = `${prefabTypeName}.${spawnTypeName}`;
                this.elements.addPrefabSelect.append(option);
            }
        }

        // Add click event listeners
        document.getElementById('scene-translate-tool').addEventListener('click', () => {
            this.setGizmoMode('translate');
            this.updateGizmoToolbarUI('scene-translate-tool');
        });
        
        document.getElementById('scene-rotate-tool').addEventListener('click', () => {
            this.setGizmoMode('rotate');
            this.updateGizmoToolbarUI('scene-rotate-tool');
        });
        
        document.getElementById('scene-scale-tool').addEventListener('click', () => {
            this.setGizmoMode('scale');
            this.updateGizmoToolbarUI('scene-scale-tool');
        });
    }

    initThreeJS(canvas) {
        this.gameEditor.canvas = canvas;
        // Scene setup
        this.scene = new window.THREE.Scene();
        this.gameEditor.scene = this.scene;
        this.rootGroup = new window.THREE.Group(); // Main container for all shapes
        this.rootGroup.name = "rootGroup";
        this.scene.add(this.rootGroup);
        // Camera setup
        this.camera = new window.THREE.PerspectiveCamera(
            75, 
            canvas.clientWidth / canvas.clientHeight, 
            0.1, 
            100000
        );
        this.gameEditor.camera = this.camera;
        this.camera.position.set(100, 100, 100);
        this.camera.lookAt(0, 0, 0);

        // Renderer setup
        this.renderer = new window.THREE.WebGLRenderer({ 
            canvas: canvas, 
            antialias: false, 
            alpha: true 
        });
        this.gameEditor.renderer = this.renderer;
        this.renderer.setSize(canvas.clientWidth, canvas.clientHeight);
        this.renderer.shadowMap.enabled = true;
        this.renderer.shadowMap.type = THREE.PCFSoftShadowMap;

        // Add helpers
        const gridHelper = new window.THREE.GridHelper(1000, 100);
        this.scene.add(gridHelper);

        const axesHelper = new window.THREE.AxesHelper(10);
        this.scene.add(axesHelper);

        // Orbit controls
        this.controls = new window.THREE_.OrbitControls(this.camera, this.renderer.domElement);
        this.controls.enableDamping = true;
        this.controls.dampingFactor = 0.25;

        // Resize handling
        window.addEventListener('resize', this.handleResize.bind(this));
    }
    
    async handleRenderSceneObject(event) {
        this.canvas.width = this.gameEditor.getCollections().configs.game.canvasWidth;
        this.canvas.height = this.gameEditor.getCollections().configs.game.canvasHeight;
        this.canvas.setAttribute('style','');   
        await this.loadAssets();    
        this.clearScene();
        this.renderSceneData(event.detail.data);
        this.handleResize();
        this.clock = new window.THREE.Clock();
        this.clock.start(); 
        requestAnimationFrame(() => {
            this.state.selectedEntityIndex = -1;
        });
    }

    async loadAssets() {
        if(!this.gameEditor.modelManager.assetsLoaded){
            let collections = this.gameEditor.getCollections();
            for(let objectType in collections) {            
                await this.gameEditor.modelManager.loadModels(objectType, collections[objectType]);
            }  
        } 
    }

    animate() {
        requestAnimationFrame(this.animate.bind(this));
        this.controls.update();
        this.componentsToUpdate.forEach((component) => component.update());
        // Calculate delta once per frame
        const delta = this.clock ? this.clock.getDelta() : 0;
        this.gameEditor.deltaTime = delta;
        // Update all mixers with the same delta
        this.scene.traverse(object => {
            if (object.userData.mixer) {
                object.userData.mixer.update(delta);
            }
            if (object.isSkinnedMesh) {
                object.skeleton.update();
            }
        });
        
        if (this.gizmoManager && this.gizmoManager.targetObject) {
            this.gizmoManager.updateGizmoTransform();
        }
        this.renderer.render(this.scene, this.camera);
    }

    handleResize() {
        this.camera.aspect = this.canvas.clientWidth / this.canvas.clientHeight;
        this.camera.updateProjectionMatrix();
        this.renderer.setSize(this.canvas.clientWidth, this.canvas.clientHeight);
    }

    async handleSave(fireSave) {
     
        if (fireSave) {
            const saveEvent = new CustomEvent('saveSceneObject', {
                detail: { 
                    data: this.state.sceneData, 
                    propertyName: 'sceneData' 
                },
                bubbles: true,
                cancelable: true
            });
            document.body.dispatchEvent(saveEvent);
        } else {
            const valueElement = this.gameEditor.elements.editor
                .querySelector('#sceneData-value');
            if (valueElement) {
                let renderDataCopy = JSON.parse(JSON.stringify(this.state.sceneData));  
                valueElement.value = JSON.stringify(renderDataCopy, null, 2);
            }
        }
    }

    async renderSceneData(sceneData) {
        for(let entity of sceneData){

            const prefabData = this.gameEditor.getCollections()[entity.objectType][entity.spawnType];   
            let params = { "objectType": entity.objectType, "spawnType": entity.spawnType, "transform": entity.components[0].parameters, ...prefabData };             
            if(params.render && params.render.model){
                await this.addModelToScene(entity.type, params);                
            }
            
            this.createEntity(entity.type, params);
        }        
    }

    async createEntityFromCollections(type, params) {
        const entity = this.createEntity(type, params);  

        return entity;
    }

    async addModelToScene(name, params) {     
        const model = params.render.model;
        const modelGroup = new window.THREE.Group(); // Main container for all shapes
        modelGroup.name = name;   
        for (const groupName in model) {            
            const mergedGroup = model[groupName];
            if (mergedGroup) {
                let groupGroup = await this.shapeFactory.createGroupFromJSON(groupName, mergedGroup); 
                groupGroup.name = groupName;
                modelGroup.add(groupGroup);
            }
        }
        this.rootGroup.add(modelGroup);
        if(params.transform?.position){
            modelGroup.position.x = params.transform.position.x;
            modelGroup.position.y = params.transform.position.y;
            modelGroup.position.z = params.transform.position.z;
        }
        if(params.transform?.scale){
            modelGroup.scale.x = params.transform.scale.x;
            modelGroup.scale.y = params.transform.scale.y;
            modelGroup.scale.z = params.transform.scale.z;
        }
        if(params.transform?.rotation){
            modelGroup.rotation.x = params.transform.rotation.x;
            modelGroup.rotation.y = params.transform.rotation.y;
            modelGroup.rotation.z = params.transform.rotation.z;
        }
    }

    async clearScene() {
        this.componentsToUpdate.forEach((component) => component.destroy());
        this.componentsToUpdate = [];
        while (this.rootGroup.children.length > 0) {
            const obj = this.rootGroup.children[0];
            this.shapeFactory.disposeObject(obj);
            this.rootGroup.remove(obj);
        }        
        this.state.sceneData = []; 
    }

    createEntity(type, prefabData) {
        const id = this.nextEntityId++;
        const entity = {
            id,
            type,
            objectType: prefabData.objectType,
            spawnType: prefabData.spawnType,
            parent: null,
            children: [],
            components: this.getEntityComponents(type, prefabData)
        };


        this.state.sceneData.push(entity);
        this.handleSave(false);
        this.renderHierarchy();
        
        return entity;
    }

    getEntityComponents(type, prefabData){
        let components = [];
        // Add transform component by default
        components.push({
            type: 'transform',
            parameters: {
                position: prefabData.transform && prefabData.transform.position ? prefabData.transform.position : { x: 0, y: 0, z: 0 },
                rotation: prefabData.transform && prefabData.transform.rotation ? prefabData.transform.rotation : { x: 0, y: 0, z: 0 },
                scale: prefabData.transform && prefabData.transform.scale ? prefabData.transform.scale : { x: 1, y: 1, z: 1 }
            }
        });
        const entityObjData = this.gameEditor.getCollections().entities[type];
        const combined = [...entityObjData.renderers, ...entityObjData.components];

        let compsToInit = [];
         
        combined.forEach((componentName) => {
         
            const componentDataKey = componentName.charAt(0).toLowerCase() + componentName.slice(1, componentName.length);
            const compInstanceId = prefabData[componentDataKey];
            if(compInstanceId){
                let componentDef = this.gameEditor.getCollections().components[componentName];
                if(!componentDef) {
                    componentDef = this.gameEditor.getCollections().renderers[componentName];
                }

                let component = {
                    type: componentName,
                    parameters: {}
                };       
                const componentDataCollectionDef = this.gameEditor.getCollectionDefs().find(t => 
                    componentName.toLowerCase().endsWith(t.singular.replace(/ /g,'').toLowerCase()));
                
                component.parameters[componentDataCollectionDef.singular.charAt(0).toLowerCase() + componentDataCollectionDef.singular.slice(1, componentDataCollectionDef.singular.length)] = compInstanceId;
                components.push(component);
                
                if(componentDef.updateInEditor){
             

                    let comp = this.gameEditor.instantiateComponent(componentName);
                    let params = {...prefabData, ...component.parameters, isEditor: true};
                    compsToInit.push({
                        component: comp,
                        params: params
                    })
                }
            }
        });

        compsToInit.forEach((compObj) => {
            let comp = compObj.component;
            let params = compObj.params;
            comp.init(params)
            this.componentsToUpdate.push(comp);
        })
 
        return components;
    }

    addComponent(entity, componentType) {
        if (!entity) return;
        
        // Check if the component already exists
        const exists = entity.components.some(c => c.type === componentType);
        if (exists) {
            console.log(`Entity already has a ${componentType} component`);
            return;
        }
        
        let component = {
            type: componentType,
            parameters: {}
        };
        
        // Initialize parameters based on component type
        switch (componentType) {
            case 'meshRenderer':
                component.parameters = {
                    geometry: entity.type || 'cube',
                    material: 'standard',
                    color: '#cccccc',
                    receiveShadow: true,
                    castShadow: true
                };
                break;
            case 'light':
                component.parameters = {
                    type: 'point',
                    color: '#ffffff',
                    intensity: 1.0,
                    castShadow: true
                };
                break;
            case 'collider':
                component.parameters = {
                    type: 'box',
                    isTrigger: false,
                    size: { x: 1, y: 1, z: 1 }
                };
                break;
            case 'rigidbody':
                component.parameters = {
                    mass: 1.0,
                    drag: 0.1,
                    useGravity: true,
                    isKinematic: false
                };
                break;
            case 'audio':
                component.parameters = {
                    clip: 'none',
                    volume: 1.0,
                    pitch: 1.0,
                    loop: false,
                    playOnAwake: false
                };
                break;
            case 'script':
                component.parameters = {
                    script: 'NewScript.js',
                    enabled: true
                };
                break;
        }
        
        entity.components.push(component);
        
        // Re-render the inspector to show the new component
        if (this.state.selectedEntity === entity) {
            this.selectEntity(entity);
        }
    }

    removeComponent(entity, componentType) {
        if (!entity) return;
        
        // Don't allow removing transform component
        if (componentType === 'transform') {
            console.log("Cannot remove transform component");
            return;
        }
        
        const index = entity.components.findIndex(c => c.type === componentType);
        if (index !== -1) {
            entity.components.splice(index, 1);
            
            // Re-render the inspector
            if (this.state.selectedEntity === entity) {
                this.selectEntity(entity);
            }
        }
    }

    renderHierarchy() {
        this.elements.hierarchy.innerHTML = '';
        
        // Get top-level entities (those without a parent)
        const rootEntities = this.state.sceneData.filter(e => e.parent === null);
        
        // Render each root entity and its children
        rootEntities.forEach(entity => {
            this.renderEntityInHierarchy(entity, this.elements.hierarchy);
        });
    }

    renderEntityInHierarchy(entity, parentElement, level = 0) {
        const itemEl = document.createElement('div');
        itemEl.className = 'hierarchy-item';
        itemEl.dataset.entityId = entity.id;
        
        if (this.state.selectedEntity === entity) {
            itemEl.classList.add('selected');
        }    
        // Create entity name
        const nameEl = document.createElement('span');
        nameEl.textContent = entity.type;
        itemEl.appendChild(nameEl);
        
        // Add click event
        itemEl.addEventListener('click', () => {
            this.selectEntity(entity);
        });
        
        parentElement.appendChild(itemEl);
        
        // Find children of this entity
        const children = this.state.sceneData.filter(e => e.parent === entity);
        children.forEach(child => {
            this.renderEntityInHierarchy(child, parentElement, level + 1);
        });
    }

    selectEntity(entity) {
        // Clear previous selection
        const prevSelected = document.querySelector('.hierarchy-item.selected');
        if (prevSelected) {
            prevSelected.classList.remove('selected');
        }
        
        this.state.selectedEntity = entity;
        
        // Update hierarchy selection
        const entityEl = document.querySelector(`.hierarchy-item[data-entity-id="${entity.id}"]`);
        if (entityEl) {
            entityEl.classList.add('selected');
        }
        
        // Show inspector with entity data
        this.renderInspector();

        if (entity) {
            const entityObject = this.findEntityObject(entity);            
            if (entityObject) {
                this.state.selectedEntityObject = entityObject;
                this.gizmoManager.attach(entityObject);
            } else {
                this.state.selectedEntityObject = null;
                this.gizmoManager.detach();
            }
        } else {
            this.gizmoManager.detach();
        }
    }

    renderInspector() {
        // Show/hide the appropriate sections
        if (!this.state.selectedEntity) {
            this.elements.noSelection.style.display = 'block';
            this.elements.entityInspector.style.display = 'none';
            return;
        }
        
        this.elements.noSelection.style.display = 'none';
        this.elements.entityInspector.style.display = 'block';
        
        // Update transform values
        const entity = this.state.selectedEntity;


        if (entity) {
            // Clear and re-render components
            this.elements.components.innerHTML = '';
            
            entity.components.forEach(component => {        
                this.renderComponent(component);
            });
            const entityObject = this.findEntityObject(entity);
            if (entityObject) {
                // Sync transform values from entity to 3D object
                const transformComponent = entity.components.find(c => c.type === 'transform');
                if (transformComponent) {
                    const position = transformComponent.parameters.position;
                    const rotation = transformComponent.parameters.rotation;
                    const scale = transformComponent.parameters.scale;
                    
                    entityObject.position.set(position.x, position.y, position.z);
                    entityObject.rotation.set(rotation.x, rotation.y, rotation.z);
                    entityObject.scale.set(scale.x, scale.y, scale.z);
                    
                    // Update gizmo position
                    this.gizmoManager.updateGizmoTransform();
                }
            }
        }
    }

    renderComponent(component) {
        const componentEl = document.createElement('div');
        componentEl.className = 'component-section';
        
        // Component header
        const headerEl = document.createElement('h3');
        headerEl.className = 'component-header';        
        headerEl.textContent = this.formatComponentName(component.type);
        
        // Remove component button
        const removeBtn = document.createElement('button');
        removeBtn.className = 'btn';
        removeBtn.textContent = 'X';
        removeBtn.addEventListener('click', () => {
            this.removeComponent(this.state.selectedEntity, component.type);
        });
        headerEl.appendChild(removeBtn);
        
        componentEl.appendChild(headerEl);
        
        // Component parameters
        Object.entries(component.parameters).forEach(([key, value]) => {
            const propEl = document.createElement('div');
            propEl.className = 'property';
            
            // Property label
            const labelEl = document.createElement('label');
            labelEl.textContent = this.formatPropertyName(key);
            propEl.appendChild(labelEl);
            
            // Property input
            let inputEl;
            
            if (typeof value === 'boolean') {
                // Boolean checkbox
                inputEl = document.createElement('input');
                inputEl.type = 'checkbox';
                inputEl.checked = value;
                inputEl.dataset.key = key;
            } else if (typeof value === 'number') {
                // Number input
                inputEl = document.createElement('input');
                inputEl.type = 'number';
                inputEl.value = value;
                inputEl.step = key.includes('scale') ? '0.1' : '1';
                inputEl.dataset.key = key;
            } else if (typeof value === 'object' && value !== null) {
                // Vector3 input for position, rotation, scale, etc.
                inputEl = document.createElement('div');
                inputEl.className = 'vector3-input';
                
                ['x', 'y', 'z'].forEach(axis => {
                if (axis in value) {
                    const axisInput = document.createElement('input');
                    axisInput.type = 'number';
                    axisInput.value = value[axis];
                    axisInput.step = '0.1';
                    axisInput.dataset.axis = axis;
                    axisInput.dataset.key = key;
                    inputEl.appendChild(axisInput);
                }
                });
            } else if (key === 'type' && component.type === 'light') {
                // Select dropdown for light type
                inputEl = document.createElement('select');
                ['directional', 'point', 'spot', 'ambient'].forEach(type => {
                    const option = document.createElement('option');
                    option.value = type;
                    option.textContent = this.formatPropertyName(type);
                    option.selected = value === type;
                    inputEl.appendChild(option);
                });
                inputEl.dataset.key = key;
            } else if (key === 'color') {
                // Color input
                inputEl = document.createElement('div');
                inputEl.className = 'color-input';
                
                const colorInput = document.createElement('input');
                colorInput.type = 'text';
                colorInput.value = value;
                inputEl.appendChild(colorInput);
                
                const colorPreview = document.createElement('div');
                colorPreview.className = 'color-preview';
                colorPreview.style.backgroundColor = value;
                inputEl.appendChild(colorPreview);
                colorInput.dataset.key = key;
            } else {
                // Default text input
                inputEl = document.createElement('input');
                inputEl.type = 'text';
                inputEl.value = value;
                inputEl.dataset.key = key;
            }
            inputEl.addEventListener('change', (e)=> {
                if(e.target.dataset.axis) {                   
                    component.parameters[e.target.dataset.key][e.target.dataset.axis] = Number(e.target.value);
                    this.state.selectedEntityObject[e.target.dataset.key][e.target.dataset.axis] = Number(e.target.value);
                } else {
                    component.parameters[e.target.dataset.key] = e.target.value;
                }
                this.handleSave(false);
            });
            propEl.appendChild(inputEl);
            componentEl.appendChild(propEl);
        });
        
        this.elements.components.appendChild(componentEl);
    }
    
    formatComponentName(name) {
        // Convert camelCase or snake_case to Title Case with spaces
        return name
        .replace(/([A-Z])/g, ' $1')
        .replace(/_/g, ' ')
        .replace(/^./, str => str.toUpperCase());
    }
    
    formatPropertyName(name) {
        // Convert camelCase or snake_case to Title Case with spaces
        return name
        .replace(/([A-Z])/g, ' $1')
        .replace(/_/g, ' ')
        .replace(/^./, str => str.toUpperCase());
    }
    
    getMergedGroup(groupName){
        let model = this.state.renderData.model;
        const modelGroup = model[groupName];
        if(this.state.editingModel){
            return modelGroup;
        }
        return this.shapeFactory.getMergedGroup(model, this.getCurrentAnimation()[this.state.currentFrame], groupName );
    }

    updateGizmoToolbarUI(activeButtonId) {
        // Remove active class from all buttons
        document.querySelectorAll('.gizmo-btn').forEach(btn => {
            btn.classList.remove('active');
        });
        
        // Add active class to the clicked button
        document.getElementById(activeButtonId).classList.add('active');
    }
    
    setGizmoMode(mode) {
        if (this.gizmoManager) {
            this.gizmoManager.setMode(mode);
        }
    }
    findEntityObject(entity) {
        // Look for the object in the scene with the same name as the entity type
        // This needs to be adjusted based on how your entities are mapped to 3D objects
        const entityName = entity.type;
        
        let foundObject = null;
        this.rootGroup.traverse((object) => {
            if (object.name === entityName) {
                foundObject = object;
            }
        });
        
        return foundObject;
    }
}

aiPromptPanel.script:
class AIPromptPanel {
    constructor(gameEditor) {
        this.gameEditor = gameEditor;
      console.log(this.gameEditor);
        const aiConfig = this.gameEditor.getCollections().configs.ai;
        this.elements = {
            launchBtn: null,
            aiPromptModal: null,
            promptTextarea: null,
            sendBtn: null,
            closeBtn: null,
            previewArea: null,
            applyBtn: null
        };
        this.init(aiConfig);
    }

    init(aiConfig) {
       this.setupHooks();
        // Create the AI Prompt Modal
        const modal = document.getElementById('modal-aiPromptPanel');

        this.config = aiConfig;
        // Cache elements
        this.elements = {
            aiPromptModal: modal,
            promptTextarea: modal.querySelector('#ai-prompt-textarea'),
            prePromptTextarea: modal.querySelector('#ai-pre-prompt-textarea'),
            sendBtn: modal.querySelector('#send-ai-prompt-btn'),
            closeBtn: modal.querySelector('#close-ai-prompt-modal'),
            previewArea: modal.querySelector('#ai-response-preview'),
            applyBtn: modal.querySelector('#apply-ai-response-btn')
        };

        // Setup event listeners
        this.setupEventListeners();
    }

    setupEventListeners() {
        this.elements.sendBtn.addEventListener('click', () => this.sendPromptToAI());
        this.elements.closeBtn.addEventListener('click', () => {
            this.elements.aiPromptModal.classList.remove('show');
        });
        this.elements.applyBtn.addEventListener('click', () => {
            this.applyAIResponse();
        });
    }

    setupHooks() {
        
        document.body.addEventListener('renderEditor', () => {
            if(this.elements.launchBtn) this.elements.launchBtn.remove();
            this.elements.launchBtn = document.createElement('button');
            this.elements.launchBtn.innerHTML = "AI Prompt";
            this.elements.launchBtn.id = 'ai-prompt-modal';
            this.gameEditor.elements.editor.querySelector(".actions>div")?.appendChild(this.elements.launchBtn);
            this.elements.launchBtn.addEventListener('click', () => {
                this.showModal();
            });
        });
    }

    generateContextPrompt(object) {
        const type = this.gameEditor.model.getSingularType(this.gameEditor.model.state.selectedType);
		let defaultPrompt = this.config.defaultPrompt.trim().replace(/\$\{type\}/g, type);
        let outputObj = {...object};
        const { selectedObject } = this.gameEditor.model.state;
        outputObj.id = selectedObject;
        
        return `${defaultPrompt}\n\nContext Object: \n\n${JSON.stringify(outputObj, null, 2)}`;
		
    }

    async sendPromptToAI() {
        const prompt = `${this.elements.prePromptTextarea.value} \n\n ${this.elements.promptTextarea.value}`;

        try {
            this.elements.previewArea.value = "Generating ..."; // Use .value for textarea

            const { aiEndPoint, aiModel, apiKey, headers, requestBody } = this.prepareAIConfig(prompt);
            console.log('Request config:', { aiEndPoint, aiModel, apiKey, headers, requestBody });

            const response = await fetch(aiEndPoint, {
                method: 'POST',
                headers,
                body: JSON.stringify(requestBody)
            });

            if (!response.ok) {
                throw new Error(`AI generation failed: ${response.statusText}`);
            }

            const responseData = await response.json();
            console.log('Raw API response:', responseData);

            const aiOutput = this.extractAIOutput(responseData);
            const cleanedOutput = this.cleanOutput(aiOutput);
            console.log('Cleaned output:', cleanedOutput);

            const parsedResponse = this.parseJSONResponse(cleanedOutput);
            this.elements.previewArea.value = JSON.stringify(parsedResponse, null, 2); // Use .value
            this.elements.applyBtn.style.display = 'block';
        } catch (error) {
            console.error('AI Generation Error:', error);
            this.elements.previewArea.value = `Error: ${error.message}`; // Use .value
            this.elements.applyBtn.style.display = 'none';
        }
    }

    prepareAIConfig(prompt) {
        let updated = false;

        let aiEndPoint = this.config.aiEndPoint || "http://127.0.0.1:11434/api/generate";
        let aiModel = this.config.aiModel || "deepseek-r1:32b";
        const apiKey = this.config.aiApiKey || "";

        if (!this.config.aiEndPoint) {
            this.config.aiEndPoint = aiEndPoint;
            updated = true;
        }
        if (!this.config.aiModel) {
            this.config.aiModel = aiModel;
            updated = true;
        }
        if (updated) {
            this.gameEditor.renderObjectList();
            this.gameEditor.saveProject();
        }

        const headers = { 'Content-Type': 'application/json' };
        let requestBody = { 
            prompt, 
            model: aiModel, 
            jsonOnly: true, 
            stream: false 
        };

        if (apiKey) {
            headers.Authorization = `Bearer ${apiKey}`;
            requestBody = {
                model: aiModel,
                messages: [
                    { role: 'system', content: 'You are a helpful assistant that generates valid JSON objects based on user prompts.' },
                    { role: 'user', content: prompt }
                ],
                temperature: 0.7,
                max_tokens: 500
            };
        }

        return { aiEndPoint, aiModel, apiKey, headers, requestBody };
    }

    extractAIOutput(responseData) {
        return responseData.response || responseData.result || responseData;
    }

 cleanOutput(aiOutput) {
        const outputString = typeof aiOutput === 'string' ? aiOutput : JSON.stringify(aiOutput);
        return outputString
            .replace(/```json\s*/g, '') // Remove ```json and optional whitespace/newlines
            .replace(/```\s*/g, '')     // Remove ``` and optional whitespace/newlines
            .replace(/<think\s*>[\s\S]*?<\/think\s*>/gi, '') // Remove <think> tags
            .replace(/<think[\s\S]*?\/>/gi, '') // Remove self-closing <think> tags
            .trim(); // Remove leading/trailing whitespace
    }

    parseJSONResponse(cleanedOutput) {
        try {
            return JSON.parse(cleanedOutput);
        } catch (parseError) {
            throw new Error('Invalid JSON response from AI:\n' + cleanedOutput);
        }
    }

    applyAIResponse() {
        try {
            const responseText = this.elements.previewArea.value; // Use .value for textarea
            const parsedResponse = JSON.parse(responseText);

            if (!parsedResponse.id) {
                alert("Must include id in new object.");
                return;
            }

            const { selectedType } = this.gameEditor.model.state;
            this.gameEditor.model.getCollections()[selectedType][parsedResponse.id] = parsedResponse;

            this.gameEditor.renderObjectList();
            this.gameEditor.selectObject(parsedResponse.id); // Use new id instead of old selectedObject

            this.elements.aiPromptModal.classList.remove('show');
        } catch (error) {
            console.error('Error applying AI response:', error);
            alert('Failed to apply AI response. Please check the JSON format.');
        }
    }

    showModal() {
        const currentObject = this.gameEditor.getCurrentObject();
        this.elements.prePromptTextarea.value = this.generateContextPrompt(currentObject); // Use .value
        this.elements.previewArea.value = ''; // Use .value
        this.elements.applyBtn.style.display = 'none';
        this.elements.aiPromptModal.classList.add('show');
    }
}

AmmoWorker.script:
// Debug flag for worker
const debugWorker = false;

// Initialize Ammo.js
let AmmoLib;
let physicsWorld, collisionConfiguration, dispatcher, broadphase, solver;

const gravity = -9.8*10;
// Colliders and state
const colliders = new Map();
const collisionsThisFrame = new Map();
const minfo = new Map();
let fps = 0;
const f = [0, 0, 0];

// Entity data for ground collision
const entityData = new Map();

// Temporary objects pool to avoid creating/destroying every frame
let tempTransform = null;
let tempVec3 = null;
let tempQuat = null;
let physicsInterval = null;

function initLib(data){
    var config = {
        locateFile: () => `http://${data.hostname || "localhost:5000"}/library/ammo.wasm.wasm`
    }
    // Wait for Ammo to load
    Ammo(config).then((AmmoInstance) => {
        AmmoLib = AmmoInstance;
        collisionConfiguration = new AmmoLib.btDefaultCollisionConfiguration();
        dispatcher = new AmmoLib.btCollisionDispatcher(collisionConfiguration);
        broadphase = new AmmoLib.btDbvtBroadphase();
        solver = new AmmoLib.btSequentialImpulseConstraintSolver();
        physicsWorld = new AmmoLib.btDiscreteDynamicsWorld(dispatcher, broadphase, solver, collisionConfiguration);
        physicsWorld.setGravity(new AmmoLib.btVector3(0, gravity, 0));

        // Initialize temp objects
        tempTransform = new AmmoLib.btTransform();
        tempVec3 = new AmmoLib.btVector3(0, 0, 0);
        tempQuat = new AmmoLib.btQuaternion(0, 0, 0, 1);

        if (debugWorker) console.log("Physics initialized");
    });
    
}

self.onmessage = function(e) {

    const messageType = e.data.messageType;
    const data = e.data;

    if (messageType == 'setHostname') {                 
        initLib(data);
    } else if(AmmoLib && messageType == "staticAABBs"){
        processStaticAABBs(data);
    } else if(AmmoLib && messageType == "updateEntities"){
        updateEntities(data);
        update();
    }
};

function processStaticAABBs(data){
    const staticAABBs = data.staticAABBs;
    // Process entities
    if (staticAABBs && staticAABBs.length > 0) {

        staticAABBs.forEach(aabb => {
            if (!aabb.id || !aabb.min || !aabb.max) {
                if (debugWorker) console.warn("Skipping invalid static AABB:", aabb);
                return;
            }

            // Validate AABB dimensions
            if (aabb.max.x <= aabb.min.x || aabb.max.y <= aabb.min.y || aabb.max.z <= aabb.min.z) {
                if (debugWorker) console.warn("Invalid AABB dimensions:", aabb);
                return;
            }

            // Skip if already created
            if (colliders.has(aabb.id)) {
                if (debugWorker) console.log("Static AABB already exists:", aabb.id);
                return;
            }

            // Calculate capsule dimensions
            const height = aabb.max.y - aabb.min.y; // Full height of the trunk
            // Use a provided radius or estimate from AABB (e.g., smaller of x/z dimensions)
            const radius = aabb.radius || Math.min((aabb.max.x - aabb.min.x), (aabb.max.z - aabb.min.z)) / 2;
            if (radius <= 0 || height <= 0) {
                if (debugWorker) console.warn("Invalid capsule dimensions: radius=", radius, "height=", height, aabb);
                return;
            }

            // Create capsule shape
            const shape = new AmmoLib.btCapsuleShape(radius, height);

            // Set position (align bottom of capsule with aabb.min.y)
            const centerX = (aabb.min.x + aabb.max.x) / 2;
            const centerZ = (aabb.min.z + aabb.max.z) / 2;
            const centerY = aabb.min.y + (height / 2 + radius); // Capsule center: bottom + height/2 + radius
            tempTransform.setIdentity();
            tempVec3.setValue(centerX, centerY, centerZ);
            tempTransform.setOrigin(tempVec3);

            // Static body (mass = 0)
            const mass = 0;
            tempVec3.setValue(0, 0, 0); // No inertia for static bodies
            const motionState = new AmmoLib.btDefaultMotionState(tempTransform);
            const bodyInfo = new AmmoLib.btRigidBodyConstructionInfo(mass, motionState, shape, tempVec3);
            const body = new AmmoLib.btRigidBody(bodyInfo);

            // Set as static object
            body.setCollisionFlags(body.getCollisionFlags() | AmmoLib.btCollisionObject.CF_STATIC_OBJECT);

            // Configure body
            body.setRestitution(aabb.restitution || 0.5);
            body.setFriction(aabb.friction || 0.5);
            body.userData = { id: aabb.id, collider: { type: 'capsule', static: true }, reflected: false };

            // Add to physics world
            physicsWorld.addRigidBody(body);
            colliders.set(aabb.id, body);
            minfo.set(aabb.id, new Float32Array(8));

            AmmoLib.destroy(bodyInfo);

            if (debugWorker) console.log("Created static capsule collider:", aabb.id, "center:", { x: centerX, y: centerY, z: centerZ }, "radius:", radius, "height:", height);
        });
    }
}

function updateEntities(data){
    collisionsThisFrame.clear();
    if (data.entities && data.entities.length > 0) {
        data.entities.forEach(entity => {
            if (!entity.id) {
                if (debugWorker) console.warn("Skipping entity with missing ID or collider:", entity);
                return;
            }
            
            // Store ground height for the entity
            if (entity.groundHeight !== undefined) {
                entityData.set(entity.id, {
                    groundHeight: entity.groundHeight
                });
            }

            if (!colliders.has(entity.id)) {
                // Create new rigid body
                let shape;
                if (entity.type === 'sphere') {
                    const radius = Array.isArray(entity.size) ? entity.size[0] || 0.5 : entity.size || 0.5;
                    shape = new AmmoLib.btSphereShape(radius);
                } else if (entity.type === 'box') {
                    const size = Array.isArray(entity.size) ? entity.size : [1, 1, 1];
                    tempVec3.setValue(size[0] || 1, size[1] || 1, size[2] || 1);
                    shape = new AmmoLib.btBoxShape(tempVec3);
                } else {
                    if (debugWorker) console.warn("Unsupported collider type:", entity.type);
                    return;
                }

                tempTransform.setIdentity();
                tempVec3.setValue(
                    entity.positionX || 0,
                    entity.positionY || 0,
                    entity.positionZ || 0
                );
                tempTransform.setOrigin(tempVec3);
                
                if (entity.quaternion) {
                    tempQuat.setValue(
                        entity.quaternionX || 0,
                        entity.quaternionY || 0,
                        entity.quaternionZ || 0,
                        entity.quaternionW || 1
                    );
                    tempTransform.setRotation(tempQuat);
                }

                const mass = entity.mass || 1;
                tempVec3.setValue(0, 0, 0); // Reuse for inertia
                if (mass > 0) {
                    shape.calculateLocalInertia(mass, tempVec3);
                }

                const motionState = new AmmoLib.btDefaultMotionState(tempTransform);
                const bodyInfo = new AmmoLib.btRigidBodyConstructionInfo(mass, motionState, shape, tempVec3);
                const body = new AmmoLib.btRigidBody(bodyInfo);
                body.setCcdMotionThreshold(1); // Trigger CCD at small motion
                body.setCcdSweptSphereRadius(entity.size / 2); // Sphere radius for CCD
          
                body.setRestitution(entity.restitution || 0.5);
                body.setFriction(0.5);
                tempVec3.setValue(
                    entity.velocityX,
                    entity.velocityY,
                    entity.velocityZ
                );
                body.setLinearVelocity(tempVec3);
                
                body.setCollisionFlags(0);
                physicsWorld.addRigidBody(body);
                body.userData = { id: entity.id, collider: entity, reflected: false };

                colliders.set(entity.id, body);
                minfo.set(entity.id, new Float32Array(8));

                AmmoLib.destroy(bodyInfo);

                if (debugWorker) console.log("Created collider:", entity.id, entity.type);
            } else {
                // Update existing rigid body
                const body = colliders.get(entity.id);
                body.userData.reflected = entity.reflected;


                if (entity.reflected) {

                        // Set the body collision flag to kinematic
             //       body.setCollisionFlags(2); // 2 is kinematic


                                       // Teleport the body to the new position
                    // tempTransform.setIdentity();
                    // tempVec3.setValue(
                    //     entity.positionX,
                    //     entity.positionY,
                    //     entity.positionZ
                    // );
                    // tempTransform.setOrigin(tempVec3);

                    // Set the velocity (optional: you can keep the existing velocity or set a new one)
                    tempVec3.setValue(
                        entity.velocityX,
                        entity.velocityY,
                        entity.velocityZ
                    );
                    body.setLinearVelocity(tempVec3);
                    //body.setCollisionFlags(0);
                

                    // // Update motion state to teleport the body
                    // const motionState = body.getMotionState();
                    // motionState.setWorldTransform(tempTransform);
                    // body.setMotionState(motionState);
                }           
            }
        });
    }

    if (data.removeColliders && data.removeColliders.length > 0) {
        data.removeColliders.forEach(id => {
            const body = colliders.get(id);
            if (body) {
                physicsWorld.removeRigidBody(body);
                AmmoLib.destroy(body.getCollisionShape());
                AmmoLib.destroy(body.getMotionState());
                AmmoLib.destroy(body);
                colliders.delete(id);
                minfo.delete(id);
                entityData.delete(id); // Also remove entity data
                if (debugWorker) console.log("Removed collider:", id);
            }
        });
    }


  
}


function update() {
    if(physicsWorld){
        physicsWorld.stepSimulation(1/60, 5);

        const numManifolds = dispatcher.getNumManifolds();
        for (let i = 0; i < numManifolds; i++) {
            const manifold = dispatcher.getManifoldByIndexInternal(i);
            const body0 = manifold.getBody0();
            const body1 = manifold.getBody1();
            const numContacts = manifold.getNumContacts();
            if (numContacts > 0) {
                const id0 = body0.userData?.id;
                const id1 = body1.userData?.id;

                if (id0 && id1) {
                    if (!collisionsThisFrame.has(id0)) collisionsThisFrame.set(id0, []);
                    if (!collisionsThisFrame.has(id1)) collisionsThisFrame.set(id1, []);
                    collisionsThisFrame.get(id0).push(id1);
                    collisionsThisFrame.get(id1).push(id0);
                }
            }
        }
    }
    const updatedEntities = [];
    const tempTransform = new AmmoLib.btTransform(); // Temp transform for getting world transforms

    colliders.forEach((body, id) => {
        if(body.userData.collider.static) return;
        const info = minfo.get(id);
        body.getMotionState().getWorldTransform(tempTransform);
        const origin = tempTransform.getOrigin();
        const rotation = tempTransform.getRotation();

        info[0] = origin.x();
        info[1] = origin.y();
        info[2] = origin.z();
        info[3] = rotation.x();
        info[4] = rotation.y();
        info[5] = rotation.z();
        info[6] = rotation.w();
        info[7] = body.isActive() ? 0 : 1;

        const velocity = body.getLinearVelocity();
        const collisions = collisionsThisFrame.get(id) || [];
        const collidedWithTerrain = collisions.includes('terrain');
        const entityCollisions = collisions.filter(cid => cid !== 'terrain');
        if(!isNaN(info[0])){
          updatedEntities.push({
              id,
              positionX: info[0], 
              positionY: info[1], 
              positionZ: info[2],
              quaternionX: info[3], 
              quaternionY: info[4], 
              quaternionZ: info[5], 
              quaternionW: info[6],
              velocityX: velocity.x(),
              velocityY: velocity.y(),
              velocityZ: velocity.z(),
              sleeping: info[7] === 1,
              collisions: entityCollisions,
              collidedWithTerrain: collidedWithTerrain
          });
        }
    });

    // Clean up temporary transform
    AmmoLib.destroy(tempTransform);

    // Calculate FPS
    f[1] = Date.now();
    if (f[1] - 1000 > f[0]) {
        f[0] = f[1];
        fps = f[2];
        f[2] = 0;
    }
    f[2]++;

    self.postMessage({
        perf: fps,
        entities: updatedEntities
    });
}

// Clean up function - call this when terminating the worker
function cleanup() {
    if (!AmmoLib) return;
    
    // Clean up all colliders
    colliders.forEach((body, id) => {
        physicsWorld.removeRigidBody(body);
        AmmoLib.destroy(body.getCollisionShape());
        AmmoLib.destroy(body.getMotionState());
        AmmoLib.destroy(body);
    });
    colliders.clear();
    entityData.clear();
    
    // Clean up temporary objects
    AmmoLib.destroy(tempTransform);
    AmmoLib.destroy(tempVec3);
    AmmoLib.destroy(tempQuat);
    
    // Clean up physics world
    AmmoLib.destroy(physicsWorld);
    AmmoLib.destroy(solver);
    AmmoLib.destroy(broadphase);
    AmmoLib.destroy(dispatcher);
    AmmoLib.destroy(collisionConfiguration);
}

// Handle worker termination
self.addEventListener('close', () => {
    cleanup();
});

