CoordinateTranslator.script:
class CoordinateTranslator {
    constructor(config, mapSize, isometric = false) {
        this.isometric = isometric;
        this.tileWidth = config.gridSize;
        this.tileHeight = config.gridSize * 0.5;
        this.canvasWidth = config.canvasWidth;
        this.canvasHeight = config.canvasHeight;
        this.mapSize = mapSize;
    }

    // Pixel (top-down) to Grid
    pixelToGrid(pixelX, pixelY) {
        return {
            x: pixelX / this.tileWidth,
            y: pixelY / this.tileWidth
        };
    }

    // Grid to Isometric (with vertical centering)
    gridToIso(gridX, gridY) {
        // If not isometric, return grid coordinates as-is
        if (!this.isometric) {
            return { x: gridX * this.tileWidth, y: gridY * this.tileWidth };
        }

        const isoX = (gridX - gridY) * (this.tileWidth / 2) + this.canvasWidth / 2;
       
        // Calculate the height the grid would occupy
        const totalGridHeight = this.mapSize * this.tileHeight;
       
        // Center vertically by adding an offset
        const verticalOffset = (this.canvasHeight - totalGridHeight) / 2;
       
        const isoY = (gridX + gridY) * (this.tileHeight / 2) + verticalOffset;
       
        return { x: isoX, y: isoY };
    }

    // Pixel (top-down) to Isometric
    pixelToIso(pixelX, pixelY) {
        if(!this.isometric){
            return {
                x: pixelX + ( this.canvasWidth - this.mapSize * this.tileWidth) / 2,
                y: pixelY + ( this.canvasHeight - this.mapSize * this.tileWidth) / 2
            }
        }
        const grid = this.pixelToGrid(pixelX, pixelY);
        return this.gridToIso(grid.x, grid.y);
    }

    isoToGrid(isoX, isoY) {
        // If not isometric, convert directly to grid
        if (!this.isometric) {
            return {
                x: isoX / this.tileWidth,
                y: isoY / this.tileWidth
            };
        }

        const adjustedX = isoX - this.canvasWidth / 2;
       
        // Calculate the same vertical offset as in gridToIso
        const totalGridHeight = this.mapSize * this.tileHeight;
        const verticalOffset = (this.canvasHeight - totalGridHeight) / 2;
       
        // Subtract the offset before conversion
        const adjustedY = isoY - verticalOffset;
       
        const gridX = (adjustedX / (this.tileWidth / 2) + adjustedY / (this.tileHeight / 2)) / 2;
        const gridY = (adjustedY / (this.tileHeight / 2) - adjustedX / (this.tileWidth / 2)) / 2;
       
        return { x: gridX, y: gridY };
    }

    isoToPixel(isoX, isoY) {
        const grid = this.isoToGrid(isoX, isoY);
        return {
            x: grid.x * this.tileWidth,
            y: grid.y * this.tileWidth
        };
    }

    // Snap grid coordinates to nearest integer
    snapToGrid(gridX, gridY) {
        return { x: Math.floor(gridX), y: Math.floor(gridY) };
    }
}

Entity.script:
class Entity {
    constructor(game, type) {
        this.game = game;
        this.moduleManager = game.moduleManager;        
        this.components = [];
        this.renderers = [];
        this.destroyed = false;        
        this.id = ++game.entityId;
        this.type = type;
        this.collisionRadius = 5;   
        this.entityHeight = 10;        
    }

    init(params) {
        for(let c in this.components) {
            this.components[c].init(params);               
        }     
    }
    getAABB(position = this.transform.position) {
        return {
            min: {
                x: position.x - this.collisionRadius,
                y: position.y,
                z: position.z - this.collisionRadius
            },
            max: {
                x: position.x + this.collisionRadius,
                y: position.y + this.entityHeight,
                z: position.z + this.collisionRadius
            }
        };
    }

    getComponent(name) {
        return this.components[name.toLowerCase()] || this.components[`${name.toLowerCase()}`];
    }
    addRenderer(RendererClassName, params) {
        const RendererClass = this.moduleManager.getCompiledScript(RendererClassName, 'renderers');
        const renderer = new RendererClass(this.game, this);
        this.renderers[RendererClass.name.toLowerCase()] = renderer;
        this.components[RendererClass.name.toLowerCase()] = renderer;
        if(params){
            renderer.init(params);
        }
        return renderer;
    }
    addComponent(ComponentClassName, params) {        
        const ComponentClass = this.moduleManager.getCompiledScript(ComponentClassName, 'components');
        const component = new ComponentClass(this.game, this);
        this.components[ComponentClass.name.toLowerCase()] = component;
        if(params){
            component.init(params);
        }
        return component;
    }
    getNetworkComponentData(){
        let data = {};
        for(let c in this.components) {
            let cData = this.components[c].getNetworkData(); 
            if(cData){
                data[c] = cData;
            }
        }    
        return data;
    }
    setNetworkComponentData(data, isRemote=false){            
        if(data?.components){
            for(let c in data.components) {
                this.components[c]?.setNetworkData(data.components[c], isRemote); 
            }    
        }
    }
    removeComponent(component) {
        let index = this.components.indexOf(component);
        if( index >= 0 ) {
            this.components.splice(index, 1);
        }
    }
    update() {    
        for(let c in this.components) {
            this.components[c].update(); 
            if(this.destroyed) break;
        }                
    }
    postUpdate() {
        for(let c in this.components) {
            this.components[c].postUpdate();   
            if(this.destroyed) break;
        }     
    }
    draw() {
        for(let r in this.renderers) {
            this.renderers[r].draw();  
        }

    }
    OnCollision(collidedWith){
        for(let c in this.components) {
            this.components[c].OnCollision(collidedWith);                           
        }                
    }
    OnStaticCollision(){
        for(let c in this.components) {
            this.components[c].OnStaticCollision();                           
        }                
    }
    OnGrounded(){
        for(let c in this.components) {
            this.components[c].OnGrounded();                           
        }                
    }
    onPhysicsUpdate(timestamp, physicsStepMs)  {
        for(let c in this.components) {
            this.components[c].onPhysicsUpdate(timestamp, physicsStepMs);                           
        }     
    }
    destroy() {
        this.destroyed = true;
        for(let c in this.components) {
            this.components[c].destroy();   
        }   
        for(let r in this.renderers) {
            this.renderers[r].destroy();   
        }   
    }
}

GameState.script:
class GameState {
    constructor(gameConfig = {}) {
        let state = gameConfig.configs.state;
     
        // Clear all existing properties
        for (let prop in this) {
            if (Object.prototype.hasOwnProperty.call(this, prop)) {
                delete this[prop];
            }
        }

        // Set only the properties from params
        for (let key in state) {
            if (Object.prototype.hasOwnProperty.call(state, key)) {
                this[key] = state[key];
            }
        }
        this.entities = [];
        // If stats is present, create defaultStats as a copy
  
    }

    addEntity(entity) {
        this.entities.push(entity);
    }
    removeEntity(entity) {
    
        let index = this.entities.indexOf(entity);
        if( index >= 0 ) {
            this.entities.splice(index, 1);
        }
    }
}

ExportScripts.script:
class ExportScripts {
  constructor(app) {
     this.app = app;
  }
  export(project) {
      // Initialize JSZip
      const zip = new GUTS.JSZip();

      // Iterate over each script type (e.g., "renderers", "components")
      Object.keys(project).forEach(scriptType => {
          const scripts = project[scriptType];

          // Create a folder for the script type
          const folder = zip.folder(`scripts/${scriptType}`);

          // Iterate over each script key (e.g., "renderer", "component")
          Object.keys(scripts).forEach(scriptKey => {
              const scriptData = scripts[scriptKey];
              const scriptContent = scriptData.script || ''; // Fallback to empty string if no script

              // Add the script file to the folder
              folder.file(`${scriptKey}.js`, scriptContent);
          });
      });

      // Generate the zip file and trigger download
      zip.generateAsync({ type: 'blob' }).then(blob => {
          // Create a temporary URL for the blob
          const url = window.URL.createObjectURL(blob);

          // Create a temporary link element to trigger download
          const link = document.createElement('a');
          link.href = url;
          link.download = 'scripts.zip'; // Name of the downloaded file
          document.body.appendChild(link);
          link.click();

          // Clean up
          document.body.removeChild(link);
          window.URL.revokeObjectURL(url);
      }).catch(error => {
          console.error('Error generating zip file:', error);
      });
  }
}

GE_AnimationManager.script:
class GE_AnimationManager {
    constructor(gameEditor, graphicsEditor) {
        this.gameEditor = gameEditor;
        this.graphicsEditor = graphicsEditor;

        this.isPreviewingAnimation = false;
    }    

    init() {   
        this.initEventListeners();
    }
    
    initEventListeners() {
        // Button event listeners
        const buttonMappings = {
            'preview-animation': this.togglePreview.bind(this),
            'add-animation': this.addNewAnimation.bind(this),
            'delete-animation': this.deleteAnimation.bind(this),
            'add-frame': this.addFrame.bind(this),
            'delete-frame': this.deleteFrame.bind(this)
        };
        Object.entries(buttonMappings).forEach(([id, handler]) => {
            const button = document.getElementById(id);
            if (button) button.addEventListener('click', handler);
        });
    }

    setPreviewAnimationState(isPreviewing) {
        this.isPreviewingAnimation = isPreviewing;
        let btn = document.getElementById('preview-animation');
        if (this.isPreviewingAnimation) {
            btn.classList.add("active");
            this.graphicsEditor.gizmoManager.destroyGizmo();
        } else {
            this.graphicsEditor.state.currentFrame = 0;
            btn.classList.remove("active");
        }
    }

    async animatePreview() {
        if (!this.isPreviewingAnimation) return;
        this.graphicsEditor.state.currentFrame = (this.graphicsEditor.state.currentFrame + 1) % this.graphicsEditor.getCurrentAnimation().length;
        await this.graphicsEditor.renderShapes(false);
        setTimeout(this.animatePreview.bind(this), 166); // ~6 FPS, adjust as needed
    }
    
    async togglePreview(e) {
        this.isPreviewingAnimation = !this.isPreviewingAnimation;
        await this.animatePreview();
        this.setPreviewAnimationState(this.isPreviewingAnimation);            
    }

    


    addNewAnimation() {
        const animName = prompt("Enter animation name:", `anim${Object.keys(this.graphicsEditor.state.renderData.animations).length + 1}`);
        if (animName && !this.graphicsEditor.state.renderData.animations[animName]) {
            this.graphicsEditor.state.renderData.animations[animName] = [ ...this.graphicsEditor.state.renderData.animations["idle"] ];
            this.graphicsEditor.state.currentAnimation = animName;
            this.graphicsEditor.state.currentFrame = 0;        
            this.graphicsEditor.refreshShapes(true);
        }
    }

    deleteAnimation() {
        if (this.graphicsEditor.state.currentAnimation !== "idle") {
            delete this.graphicsEditor.getCurrentAnimation();
            this.graphicsEditor.state.currentAnimation = "idle";
            this.graphicsEditor.state.currentFrame = 0;
            this.graphicsEditor.state.selectedShapeIndex = -1;
            this.graphicsEditor.refreshShapes(true);
        }
    }

    addFrame() {

        let currentFrame = this.graphicsEditor.getCurrentFrame();
        if(!currentFrame){
            currentFrame = {};
        }
        const newFrame = { shapes: JSON.parse(JSON.stringify(currentFrame.shapes || [])) };
        this.graphicsEditor.getCurrentAnimation().splice(this.graphicsEditor.state.currentFrame + 1, 0, newFrame);                    
        this.graphicsEditor.state.currentFrame++;
        this.graphicsEditor.refreshShapes(true);
    
    }

    deleteFrame() {
        let currentAnimation = this.graphicsEditor.getCurrentAnimation();
        if (currentAnimation.length > 1) {
            currentAnimation.splice(this.graphicsEditor.state.currentFrame, 1);
            
            this.graphicsEditor.state.currentFrame = Math.min(this.graphicsEditor.state.currentFrame, currentAnimation.length - 1);
            this.graphicsEditor.refreshShapes(true);
        }
    }
}

