class GE_GroupManager {
    constructor(gameEditor, graphicsEditor) {
        this.gameEditor = gameEditor;
        this.graphicsEditor = graphicsEditor;
        this.DEFAULT_GROUP = {
            shapes: [],
            position: { x: 0, y: 0, z: 0 },
            rotation: { x: 0, y: 0, z: 0 },
            scale: { x: 1.0, y: 1.0, z: 1.0 }
        };
    }

    init() {
        document.getElementById('create-group').addEventListener('click', this.createGroup.bind(this));
        document.getElementById('delete-group').addEventListener('click', this.deleteGroup.bind(this));
        
       
        // Update the group list initially
        this.updateGroupList();
        
        // Initialize drag-and-drop
        this.initDragAndDrop();
    }

    // Initialize drag and drop functionality
    initDragAndDrop() {
        // Make group items drop targets
        const groupList = document.getElementById('group-list');
        groupList.addEventListener('dragover', this.handleDragOver.bind(this));
        groupList.addEventListener('drop', this.handleDrop.bind(this));
    }
    
    handleDragOver(e) {
        e.preventDefault(); // Allow drop
        e.dataTransfer.dropEffect = 'move';
        
        // Highlight the group being dragged over
        const groupItem = this.findGroupItemFromEvent(e);
        if (groupItem) {
            // Remove highlight from all groups
            document.querySelectorAll('.group-item').forEach(item => {
                item.classList.remove('drag-over');
            });
            
            // Add highlight to target group
            groupItem.classList.add('drag-over');
        }
    }
    
    handleDrop(e) {
        e.preventDefault();
        
        // Remove all drag-over highlights
        document.querySelectorAll('.group-item').forEach(item => {
            item.classList.remove('drag-over');
        });
        
        // Find the target group
        const groupItem = this.findGroupItemFromEvent(e);
        if (!groupItem) return;
        
        const targetGroup = groupItem.dataset.group;
        
        // Get the shape data from dataTransfer
        const data = e.dataTransfer.getData('text/plain');
        if (!data) return;
        
        try {
            const dragData = JSON.parse(data);
            const { shapeIndex, sourceGroup } = dragData;
            
            // Don't move if source and target are the same
            if (sourceGroup === targetGroup) return;
            
            // Move the shape to the target group
            this.moveToGroup(parseInt(shapeIndex), sourceGroup, targetGroup);
        } catch (err) {
            console.error('Error processing drop:', err);
        }
    }
    
    findGroupItemFromEvent(e) {
        let target = e.target;
        // Traverse up to find the group-item
        while (target && !target.classList.contains('group-item')) {
            target = target.parentElement;
            if (!target || target === document.body) return null;
        }
        return target;
    }

    // Create a new group at the frame level
    createGroup() {
        if(!this.graphicsEditor.state.editingModel) {            
            return;
        }
        const groupName = prompt("Enter group name:", "group_" + Date.now());

        const currentFrame = this.graphicsEditor.state.currentFrame;
        
        // Ensure we have current frame data
        if (!this.graphicsEditor.getCurrentFrame()) {
            this.graphicsEditor.getCurrentAnimation()[currentFrame] = {};
        }
        
        // Switch selection to the new group
        this.graphicsEditor.state.currentGroup = groupName;
        // Initialize group if it doesn't exist
        if (!this.graphicsEditor.getCurrentGroup()) {
            // Using JSON parse/stringify for deep copying
            this.graphicsEditor.getCurrentFrame()[groupName] = JSON.parse(JSON.stringify(this.DEFAULT_GROUP));
        }
        
        
        // Refresh UI
        this.graphicsEditor.uiManager.updateList();
        this.graphicsEditor.refreshShapes(true);
    }

    // Move an object from one group to another
    moveToGroup(shapeIndex, fromGroupName, toGroupName) {
        if(!this.graphicsEditor.state.editingModel) {            
            return;
        }
        const currentFrameData = this.graphicsEditor.getCurrentFrame();
        
        // Find the shape in the source group
        const sourceGroup = currentFrameData[fromGroupName];
        if (!sourceGroup) {
            console.warn(`Source group ${fromGroupName} not found`);
            return;
        }
        
        // Find the shape
        const shapeToMove = sourceGroup.shapes[shapeIndex];
        if (!shapeToMove) {
            console.warn(`Shape at index ${shapeIndex} not found in ${fromGroupName}`);
            return;
        }
        
        // Remove from source group
        sourceGroup.shapes.splice(shapeIndex, 1);
        
        // Ensure target group exists
        if (!currentFrameData[toGroupName]) {
            currentFrameData[toGroupName] = this.DEFAULT_GROUP;
        }
        
        // Add to target group
        currentFrameData[toGroupName].shapes.push(shapeToMove);
        
        // Clear selection
        this.graphicsEditor.state.selectedShapeIndex = -1;
        
        // Update UI
        this.graphicsEditor.refreshShapes(true);
    }

    getGroupData(groupName){
        let groupData = this.graphicsEditor.getCurrentFrame()[groupName];
        if(!groupData){
            return this.graphicsEditor.state.renderData.model[groupName];
        }
        return groupData;
    }
    // Select a group to work with
    selectGroup(groupName) {
        if (!groupName) return;
        
        // Update the selected group name
        this.graphicsEditor.state.currentGroup = groupName;
        this.graphicsEditor.state.selectedShapeIndex = -1;
        let groupData = this.graphicsEditor.getMergedGroup(groupName);
        this.graphicsEditor.uiManager.updateList();
        if(groupData){
            // Update the UI to show shapes in this group
            this.graphicsEditor.uiManager.createGroupInspector(groupData);
            this.graphicsEditor.gizmoManager.transformSelectedObject(this.getGroupObject(groupName));
            
        }
        // Update the selected class on group items
        this.updateSelectedGroupClass(groupName);
    }
    updateSelectedGroupClass(groupName) {
        // Remove selected class from all group items
        const groupItems = document.querySelectorAll('.group-item');
        groupItems.forEach(item => {
            item.classList.remove('selected');
        });
        
        // Add selected class to the newly selected group
        const selectedGroupItem = Array.from(groupItems).find(
            item => item.dataset.group === groupName
        );
        
        if (selectedGroupItem) {
            selectedGroupItem.classList.add('selected');
        }
    }
    // Remove a group and place its contents back in the shapes group
    deleteGroup() {
        if(!this.graphicsEditor.state.editingModel) {            
            return;
        }
        const currentFrameData = this.graphicsEditor.getCurrentFrame();
        const currentGroup = this.graphicsEditor.getCurrentGroup();
        // Get shapes from the selected group
        const groupShapes = currentGroup.shapes;
        if (groupShapes.length > 0) {
            alert('Group must be empty to delete.');
            return;
        }
                        
        // Remove the group
        delete currentFrameData[this.graphicsEditor.state.currentGroup];
        
        // Reset selection to shapes group
        this.graphicsEditor.state.currentGroup = Object.keys(currentFrameData)[0];
        this.graphicsEditor.state.selectedShapeIndex = -1;
        
        // Update UI
        this.updateGroupList();
        this.graphicsEditor.refreshShapes(true);
    }
    getGroupObject(groupName) {
        let foundGroup = null;
        this.graphicsEditor.rootGroup.traverse(obj => {
            if (obj.isGroup && obj.name === groupName && obj.userData.isGroup) {
                foundGroup = obj;
            }
        });
        return foundGroup;
    }


    applyGroupTransform(groupName, position, rotation, scale) {
        // Get the current frame data
        const frameData = this.graphicsEditor.getCurrentFrame();
        
        // Ensure the group exists in the frame data
        if (!frameData[groupName]) {
            console.warn(`Group ${groupName} not found in frame data`);
            return;
        }
 
        // Save transformations to the group data
        frameData[groupName].position = {
            x: position.x,
            y: position.y,
            z: position.z
        };
        frameData[groupName].rotation = {
            x: rotation.x,
            y: rotation.y,
            z: rotation.z
        };
        frameData[groupName].scale = {
            x: scale.x,
            y: scale.y,
            z: scale.z
        };
    
        // Refresh the scene to see changes
        this.graphicsEditor.refreshShapes(true);
    }
    // Update the group list in the UI
    updateGroupList() {
        const list = document.getElementById('group-list');
        if (!list) {
            console.warn("Group list element not found");
            return;
        }
        
        list.innerHTML = '';
        
        for (const group of Object.keys(this.graphicsEditor.state.renderData.model)) {
            const groupItem = document.createElement('div');
            groupItem.classList.add('group-item');
            if (group === this.graphicsEditor.state.currentGroup) {
                groupItem.classList.add('selected');
            }
            
            groupItem.textContent = group;
            groupItem.addEventListener('click', () => this.selectGroup(group));
            
            // Make it a valid drop target for drag and drop
            groupItem.dataset.group = group;
            
            list.appendChild(groupItem);
        }
    }
}

GE_SceneRenderer.script:
class GE_SceneRenderer {
    constructor(gameEditor, graphicsEditor) {
        this.gameEditor = gameEditor;
        this.graphicsEditor = graphicsEditor;
        this.scene = null;
        this.camera = null;
        this.renderer = null;
        this.controls = null;
    }    

    init() {        
        this.initThreeJS();
        this.initEventListeners();
    }
    initEventListeners() {
        document.body.addEventListener('renderGraphicsObject', this.handleRenderObject.bind(this));
        document.body.addEventListener('resizedEditor', () => { 
            console.log('resized');
            this.graphicsEditor.canvas.width = this.gameEditor.getCollections().configs.game.canvasWidth;
            this.graphicsEditor.canvas.height = this.gameEditor.getCollections().configs.game.canvasHeight;
            this.graphicsEditor.canvas.setAttribute('style','');
            this.handleResize();  
            this.graphicsEditor.refreshShapes(false); 
        });
        document.getElementById('iso-generate').addEventListener('click', this.generateIsometricSprites.bind(this));
    }
    initThreeJS() {
        // Scene setup
        this.scene = new window.THREE.Scene();
        
        // Add the root group to the scene
        this.scene.add(this.graphicsEditor.rootGroup);

        // Camera setup
        this.camera = new window.THREE.PerspectiveCamera(
            75, 
            this.graphicsEditor.canvas.clientWidth / this.graphicsEditor.canvas.clientHeight, 
            0.1, 
            1000
        );
        this.camera.position.set(100, 100, 100);
        this.camera.lookAt(0, 0, 0);

        // Renderer setup
        this.renderer = new window.THREE.WebGLRenderer({ 
            canvas: this.graphicsEditor.canvas, 
            antialias: false, 
            alpha: true 
        });
        this.renderer.setSize(this.graphicsEditor.canvas.clientWidth, this.graphicsEditor.canvas.clientHeight);

        // Add helpers
        const gridHelper = new window.THREE.GridHelper(100, 10);
        this.scene.add(gridHelper);

        const axesHelper = new window.THREE.AxesHelper(10);
        this.scene.add(axesHelper);

        // Orbit controls
        this.controls = new window.THREE_.OrbitControls(this.camera, this.renderer.domElement);
        this.controls.enableDamping = true;
        this.controls.dampingFactor = 0.25;

        // Resize handling
        window.addEventListener('resize', this.handleResize.bind(this));
    }
    
    handleResize() {
        this.camera.aspect = this.graphicsEditor.canvas.clientWidth / this.graphicsEditor.canvas.clientHeight;
        this.camera.updateProjectionMatrix();
        this.renderer.setSize(this.graphicsEditor.canvas.clientWidth, this.graphicsEditor.canvas.clientHeight);
    }
    
    handleRenderObject(event) {
        this.graphicsEditor.canvas.width = this.gameEditor.getCollections().configs.game.canvasWidth;
        this.graphicsEditor.canvas.height = this.gameEditor.getCollections().configs.game.canvasHeight;
        this.graphicsEditor.canvas.setAttribute('style','');
        this.graphicsEditor.setPreviewAnimationState(false);
        this.graphicsEditor.state.renderData = event.detail.data;
        document.getElementById('json-content').value = JSON.stringify(this.graphicsEditor.state.renderData, null, 2);
        
        // Safely get first animation name
        let model = this.graphicsEditor.state.renderData.model;        
        if(!model) {
            this.graphicsEditor.state.renderData.model = JSON.parse(JSON.stringify(this.graphicsEditor.state.renderData.animations['idle'][0])); // Deep copy
            model = this.graphicsEditor.state.renderData.model;
        }
        this.graphicsEditor.state.currentAnimation = "";
        this.graphicsEditor.state.editingModel = true;
        // Safely get first frame's shapes
        const firstGroup = Object.keys(model)[0];
        const shapes = model[firstGroup].shapes || [];
        this.graphicsEditor.state.currentGroup = firstGroup;
        this.handleResize();
        this.graphicsEditor.refreshShapes(false);
        this.clock = new window.THREE.Clock();
        this.clock.start(); 
        requestAnimationFrame(() => {
            this.graphicsEditor.state.selectedShapeIndex = -1;
            this.graphicsEditor.shapeManager.selectShape(shapes.length > 0 ? 0 : -1);
        });
    }


    animate() {
        requestAnimationFrame(this.animate.bind(this));
        this.controls.update();
        
        // Calculate delta once per frame
        const delta = this.clock ? this.clock.getDelta() : 0;
        
        // Update all mixers with the same delta
        this.scene.traverse(object => {
            if (object.userData.mixer) {
                object.userData.mixer.update(delta);
            }
            if (object.isSkinnedMesh) {
                object.skeleton.update();
            }
        });
    
        this.renderer.render(this.scene, this.camera);
    }
    
    async createObjectsFromJSON(frameData, scene) {
        for(const groupName in frameData) {
            const group = await this.graphicsEditor.shapeFactory.createGroupFromJSON(groupName, frameData[groupName]);
            scene.add(group);
        }
    }
    
    async generateIsometricSprites() {
        const frustumSize = parseFloat(document.getElementById('iso-frustum').value) || 48;
        const cameraDistance = parseFloat(document.getElementById('iso-distance').value) || 100;
        const size = parseFloat(document.getElementById('iso-size').value) || 64;
        const aspect = 1;
        const tempRenderer = new window.THREE.WebGLRenderer({ antialias: false, alpha: true });
        tempRenderer.setSize(size, size);
        document.getElementById('modal-generateIsoSprites').classList.remove('show');
    
        const renderTarget = new window.THREE.WebGLRenderTarget(size, size);
        const cameras = [
            new window.THREE.OrthographicCamera(-frustumSize * aspect, frustumSize * aspect, frustumSize, -frustumSize, 0.1, 1000),
            new window.THREE.OrthographicCamera(-frustumSize * aspect, frustumSize * aspect, frustumSize, -frustumSize, 0.1, 1000),
            new window.THREE.OrthographicCamera(-frustumSize * aspect, frustumSize * aspect, frustumSize, -frustumSize, 0.1, 1000),
            new window.THREE.OrthographicCamera(-frustumSize * aspect, frustumSize * aspect, frustumSize, -frustumSize, 0.1, 1000),
            new window.THREE.OrthographicCamera(-frustumSize * aspect, frustumSize * aspect, frustumSize, -frustumSize, 0.1, 1000),
            new window.THREE.OrthographicCamera(-frustumSize * aspect, frustumSize * aspect, frustumSize, -frustumSize, 0.1, 1000),
            new window.THREE.OrthographicCamera(-frustumSize * aspect, frustumSize * aspect, frustumSize, -frustumSize, 0.1, 1000),
            new window.THREE.OrthographicCamera(-frustumSize * aspect, frustumSize * aspect, frustumSize, -frustumSize, 0.1, 1000)
        ];
    
        // Position cameras at 8 angles (45° increments)
        cameras[0].position.set(cameraDistance, cameraDistance, cameraDistance);           // NE up
        cameras[1].position.set(0, cameraDistance, cameraDistance);                       // N up
        cameras[2].position.set(-cameraDistance, cameraDistance, cameraDistance);         // NW up
        cameras[3].position.set(-cameraDistance, cameraDistance, 0);                      // W up
        cameras[4].position.set(-cameraDistance, cameraDistance, -cameraDistance);        // SW up
        cameras[5].position.set(0, cameraDistance, -cameraDistance);                      // S up
        cameras[6].position.set(cameraDistance, cameraDistance, -cameraDistance);         // SE up
        cameras[7].position.set(cameraDistance, cameraDistance, 0);                       // E up
        
        cameras.forEach(camera => camera.lookAt(0, 0, 0));
    
        const sprites = {};     
       
        for (const animType in this.graphicsEditor.state.renderData.animations) {
            sprites[animType] = [];
            for (let frameIndex = 0; frameIndex < this.graphicsEditor.state.renderData.animations[animType].length; frameIndex++) {
                const frame = this.graphicsEditor.state.renderData.animations[animType][frameIndex];
                const scene = new window.THREE.Scene();
                
                // Add lights
                const ambientLight = new window.THREE.AmbientLight(0xffffff, 0.8);
                scene.add(ambientLight);
                const directionalLight = new window.THREE.DirectionalLight(0xffffff, 1.0);
                directionalLight.position.set(5, 10, 7.5);
                scene.add(directionalLight);

                await this.createObjectsFromJSON(frame, scene);
    
                const frameSprites = [];
                for (const camera of cameras) {
                    tempRenderer.setRenderTarget(renderTarget);
                    tempRenderer.render(scene, camera);
                    const buffer = new Uint8Array(size * size * 4);
                    tempRenderer.readRenderTargetPixels(renderTarget, 0, 0, size, size, buffer);
                    const flippedBuffer = new Uint8Array(size * size * 4);
                    for (let y = 0; y < size; y++) {
                        const srcRowStart = y * size * 4;
                        const destRowStart = (size - 1 - y) * size * 4;
                        flippedBuffer.set(buffer.subarray(srcRowStart, srcRowStart + size * 4), destRowStart);
                    }
                    const canvas = document.createElement('canvas');
                    canvas.width = size;
                    canvas.height = size;
                    const ctx = canvas.getContext('2d');
                    const imageData = ctx.createImageData(size, size);
                    imageData.data.set(flippedBuffer);
                    ctx.putImageData(imageData, 0, 0);
                    frameSprites.push(canvas.toDataURL());
                }
                sprites[animType].push(frameSprites);
            }
        }
        tempRenderer.setRenderTarget(null);
        tempRenderer.dispose();
        renderTarget.dispose();
        this.graphicsEditor.displayIsometricSprites(sprites);
    }
}

GE_ShapeManager.script:
class GE_ShapeManager {
    constructor(gameEditor, graphicsEditor) {
        this.gameEditor = gameEditor;
        this.graphicsEditor = graphicsEditor;
        this.originalMaterials = new Map();
        
    }    

    init() {   
        this.initEventListeners();

    }
    initEventListeners() {
        // Button event listeners
        const buttonMappings = {
            'add-shape': this.addSelectedShape.bind(this),
            'delete-shape': this.deleteSelectedShape.bind(this)
        };
        Object.entries(buttonMappings).forEach(([id, handler]) => {
            const button = document.getElementById(id);
            if (button) button.addEventListener('click', handler);
        });
        
        document.getElementById('move-cancel').addEventListener('click', () => {            
            const inspector = document.getElementById('inspector');
            inspector.innerHTML = ``;
        });
    }
    getShapeData(shapeId){
        let currentGroup = this.graphicsEditor.getCurrentGroup();
        if(!currentGroup){
            currentGroup = { shapes: [] };
            let currentAnimation = this.graphicsEditor.getCurrentAnimation();
            let currentFrame = currentAnimation[this.graphicsEditor.state.currentFrame];
            if(!currentFrame){
                currentFrame = {};
            }
            currentFrame[this.graphicsEditor.state.currentGroup] = currentGroup;
            currentAnimation[this.graphicsEditor.state.currentFrame] = currentFrame;
        }
        currentGroup.shapes = currentGroup.shapes || [];
        if(currentGroup.shapes.length == 0){
            let shapeData = JSON.parse(JSON.stringify(this.graphicsEditor.state.renderData.model[this.graphicsEditor.state.currentGroup])).shapes[shapeId];
            shapeData.id = shapeId;
            currentGroup.shapes = [shapeData];
            return shapeData;
        }
        let shapeData = (currentGroup.shapes).find(s => s.id == shapeId);
        if(this.graphicsEditor.state.editingModel){
            shapeData = currentGroup.shapes[shapeId];
        }
        return shapeData;
    }
    selectShape(index) {
        if (this.graphicsEditor.animationManager.isPreviewingAnimation) {
            this.graphicsEditor.setPreviewAnimationState(false);
        }
        
        // Toggle selection if clicking the same shape
        this.graphicsEditor.state.selectedShapeIndex = (this.graphicsEditor.state.selectedShapeIndex === index) ? -1 : index;

        // Update shape list and highlighting
        this.graphicsEditor.uiManager.updateList();
        // Show inspector for selected shape
        const shape = this.graphicsEditor.getMergedShape();
        if (shape) {
            this.graphicsEditor.createInspector(shape);
            this.graphicsEditor.gizmoManager.transformSelectedObject();
        } else {
            this.graphicsEditor.gizmoManager.destroyGizmo();
            this.graphicsEditor.groupManager.selectGroup(this.graphicsEditor.state.currentGroup);
        }
    }
    addNewShape() {
        if(!this.graphicsEditor.state.editingModel) {            
            return;
        }
        const newShape = {
            type: 'sphere',
            size: 2,
            color: '#ff0000',
            x: 0,
            y: 0,
            z: 0,
            rotationX: 0,
            rotationY: 0,
            rotationZ: 0
        };
        this.graphicsEditor.getCurrentGroup().shapes.push(newShape);
        this.graphicsEditor.state.selectedShapeIndex = this.graphicsEditor.getCurrentGroup().shapes.length - 1;
        this.graphicsEditor.refreshShapes(true); 
    }

    addSelectedShape() {
        if(!this.graphicsEditor.state.editingModel) {            
            return;
        }
        if (this.graphicsEditor.state.selectedShapeIndex >= 0) {
            const originalShape = this.graphicsEditor.state.editingModel ? 
                                    this.graphicsEditor.getCurrentGroup().shapes[this.graphicsEditor.state.selectedShapeIndex] : 
                                    this.graphicsEditor.getCurrentGroup().shapes.find(s => s.id == this.graphicsEditor.state.selectedShapeIndex);
            const newShape = JSON.parse(JSON.stringify(originalShape));
            this.graphicsEditor.getCurrentGroup().shapes.push(newShape);
            this.graphicsEditor.state.selectedShapeIndex = this.graphicsEditor.getCurrentGroup().shapes.length - 1;
            this.graphicsEditor.refreshShapes(true);
        } else {
            this.addNewShape();
        }
    }

    deleteSelectedShape() {
        if(!this.graphicsEditor.state.editingModel) {            
            return;
        }
        if (this.graphicsEditor.state.selectedShapeIndex >= 0) {
            this.graphicsEditor.getCurrentGroup().shapes.splice(this.graphicsEditor.state.selectedShapeIndex, 1);
            if (this.graphicsEditor.getCurrentGroup().shapes.length > 0) {
                this.graphicsEditor.state.selectedShapeIndex = Math.min(this.graphicsEditor.state.selectedShapeIndex, this.graphicsEditor.getCurrentGroup().shapes.length - 1);
            } else {
                this.graphicsEditor.state.selectedShapeIndex = -1;
            }
            this.graphicsEditor.refreshShapes(true);
        }
    }

}

GE_UIManager.script:
class GE_UIManager {
    constructor(gameEditor, graphicsEditor) {
        this.gameEditor = gameEditor;
        this.graphicsEditor = graphicsEditor;
        this.mouse = new window.THREE.Vector2();
        this.raycaster = new window.THREE.Raycaster();
        this.isDragging = false;
        this.clickStartTime = 0;
    }    
     

    init() {   
        this.initEventListeners();
    }
    
    
    
    initEventListeners() {
        // Button event listeners
        const buttonMappings = {
            'generate-isometric': this.showIsometricModal.bind(this),
        };
        Object.entries(buttonMappings).forEach(([id, handler]) => {
            const button = document.getElementById(id);
            if (button) button.addEventListener('click', handler);
        });

        // Canvas interaction
        this.graphicsEditor.canvas.addEventListener('mousedown', this.handleMouseDown.bind(this));
        this.graphicsEditor.canvas.addEventListener('mousemove', this.handleMouseMove.bind(this));
        this.graphicsEditor.canvas.addEventListener('mouseup', this.handleMouseUp.bind(this));

        // Additional event listeners

        
        // Move modal listeners

        // Isometric modal listeners
        document.getElementById('iso-cancel').addEventListener('click', () => {
            document.getElementById('modal-generateIsoSprites').classList.remove('show');
        });
    }
    handleMouseDown(event) {
        this.isDragging = false;
        this.clickStartTime = Date.now();
    }

    handleMouseMove() {
        if (Date.now() - this.clickStartTime > 100) {
            this.isDragging = true;
        }
    }

    handleMouseUp(event) {
        if (this.isDragging) return;
    
        const rect = this.graphicsEditor.canvas.getBoundingClientRect();
        this.mouse.x = ((event.clientX - rect.left) / this.graphicsEditor.canvas.clientWidth) * 2 - 1;
        this.mouse.y = -((event.clientY - rect.top) / this.graphicsEditor.canvas.clientHeight) * 2 + 1;
    
        this.raycaster.setFromCamera(this.mouse, this.graphicsEditor.sceneRenderer.camera);
    
        // Instead of looking only at scene.children, search through all descendant meshes
        const meshes = [];
        this.graphicsEditor.rootGroup.traverse(obj => {
            if (obj.isMesh && obj.userData.isShape) {
                meshes.push(obj);
            }
        });
    
        const intersects = this.raycaster.intersectObjects(meshes, true);
    
        if (intersects.length > 0) {
            // Find the parent mesh with the isShape flag if we've hit a child mesh
            let hitObject = intersects[0].object;
            while (hitObject && !hitObject.userData.isShape) {
                hitObject = hitObject.parent;
            }
            
            if (hitObject && hitObject.userData.index !== undefined) {
                this.graphicsEditor.selectShape(hitObject.userData.index);
            }
        }
    }
    

    showIsometricModal() {
        document.getElementById('modal-generateIsoSprites').classList.add('show');
    }
    displayIsometricSprites(sprites) {
        const modal = document.createElement('div');
        modal.style.cssText = `
            position: fixed; top: 0; left: 0; width: 100%; height: 100%; 
            background-color: rgba(0, 0, 0, 0.7); z-index: 1000; 
            display: flex; align-items: center; justify-content: center;
        `;
        const content = document.createElement('div');
        content.style.cssText = `
            background: #333; padding: 20px; border-radius: 8px; 
            max-width: 80%; max-height: 80%; overflow: auto;
        `;
    
        const angleLabels = ['NE', 'N', 'NW', 'W', 'SW', 'S', 'SE', 'E']; // Labels for 8 angles
    
        for (const animType in sprites) {
            const animSection = document.createElement('div');
            const title = document.createElement('h3');
            title.textContent = `${animType} Animation`;
            title.style.color = '#e0e0e0';
            animSection.appendChild(title);
    
            // Create a container for all angles
            const anglesContainer = document.createElement('div');
            anglesContainer.style.cssText = `margin: 10px 0;`;
    
            // For each angle (0-7)
            for (let angle = 0; angle < 8; angle++) {
                const angleSection = document.createElement('div');
    
                const grid = document.createElement('div');
                grid.style.cssText = `
                    display: grid; 
                    grid-template-columns: repeat(${Math.min(sprites[animType].length, 4)}, 1fr); 
                    gap: 5px; 
                    margin-bottom: 15px;
                `;
    
                // Add all frames for this specific angle
                sprites[animType].forEach(frame => {
                    const img = document.createElement('img');
                    img.src = frame[angle]; // Get the specific angle's sprite
                    img.style.maxWidth = '100%';
                    grid.appendChild(img);
                });
    
                angleSection.appendChild(grid);
                anglesContainer.appendChild(angleSection);
            }
    
            animSection.appendChild(anglesContainer);
            content.appendChild(animSection);
        }
    
        const closeButton = document.createElement('button');
        closeButton.textContent = 'Close';
        closeButton.style.cssText = `
            margin-top: 20px; padding: 8px 16px; background-color: #4CAF50; 
            color: #fff; border: none; border-radius: 6px; cursor: pointer;
        `;
        closeButton.addEventListener('click', () => document.body.removeChild(modal));
        content.appendChild(closeButton);
        modal.appendChild(content);
        document.body.appendChild(modal);
    }
    
    createGroupInspector(group) {
        console.log('create group inspector', group);
        const inspector = document.getElementById('inspector');
        inspector.innerHTML = "";
        inspector.className = 'inspector';

        
        this.addFormRow(inspector, 'X Scale', 'number', 'scaleX', group.scale?.x || 1, { min: 0.1, step: 0.1 });
        this.addFormRow(inspector, 'Y Scale', 'number', 'scaleY', group.scale?.y || 1, { min: 0.1, step: 0.1 });
        this.addFormRow(inspector, 'Z Scale', 'number', 'scaleZ', group.scale?.z || 1, { min: 0.1, step: 0.1 });
        // Position inputs
        this.addFormRow(inspector, 'X Position', 'number', 'x', group.position?.x || 0, { step: 0.1 });
        this.addFormRow(inspector, 'Y Position', 'number', 'y', group.position?.y || 0, { step: 0.1 });
        this.addFormRow(inspector, 'Z Position', 'number', 'z', group.position?.z || 0, { step: 0.1 });
        
        // Rotation inputs
        this.addFormRow(inspector, 'X Rotation', 'number', 'rotationX', group.rotation?.x || 0, { step: 1 });
        this.addFormRow(inspector, 'Y Rotation', 'number', 'rotationY', group.rotation?.y || 0, { step: 1 });
        this.addFormRow(inspector, 'Z Rotation', 'number', 'rotationZ', group.rotation?.z || 0, { step: 1 });
        
    }

    createInspector(shape) {
        const inspector = document.getElementById('inspector');
        inspector.innerHTML = "";
        inspector.className = 'inspector';

        this.addFormRow(inspector, 'Name', 'text', 'name', shape.name || "");
        
        // Type selector
        this.addFormRow(inspector, 'Type', 'select', 'type', shape.type, {
            options: ['cube', 'sphere', 'box', 'cylinder', 'cone', 'torus', 'tetrahedron', 'gltf'],
            change: (e) => {
                let currentShape = this.graphicsEditor.getFrameShape();
                let newValue = e.target.value;
                if (newValue != 'gltf') {
                    delete currentShape.url
                }                 
                currentShape.type = newValue;
                this.graphicsEditor.refreshShapes(false);
            }
        });
        
        if (shape.type === 'gltf') {            
            let input = this.addFormRow(inspector, 'Model', 'file', 'url', shape.url, { 'change' :  async (e) => {
                e.preventDefault();

                // Get the file from the input element
                const file = e.target.files[0]; // Access the file object
                if (!file) {
                    console.error('No file selected');
                    return;
                }
                // // Create FormData and append the file
                 const formData = new FormData();
                 formData.append('gltfFile', file); // 'gltfFile' matches the multer.single('gltfFile') on the server
                 formData.append('projectName', this.gameEditor.getCurrentProject());
                try {
                     const response = await fetch('/upload-model', {
                         method: 'POST',
                         body: formData // Send the FormData with the file
                     });

                     const result = await response.json();
                     this.graphicsEditor.getFrameShape().url = result.filePath;
                     this.graphicsEditor.refreshShapes(false);
                } catch (error) {
                     console.error('Error uploading file:', error);
                }
            }});
            input.setAttribute("accept",".gltf,.glb");
        }
        // Color picker
        this.addFormRow(inspector, 'Color', 'color', 'color', shape.color);
        this.addFormRow(inspector, 'Texture', 'texture', 'texture', shape.texture);
        this.addFormRow(inspector, 'Metalness', 'metalness', 'metalness', shape.metalness || 0.5);
        this.addFormRow(inspector, 'Roughness', 'roughness', 'roughness', shape.roughness || 0.5);
        
        this.addFormRow(inspector, 'X Scale', 'number', 'scaleX', shape.scaleX || 1, { min: 0.1, step: 0.1 });
        this.addFormRow(inspector, 'Y Scale', 'number', 'scaleY', shape.scaleY || 1, { min: 0.1, step: 0.1 });
        this.addFormRow(inspector, 'Z Scale', 'number', 'scaleZ', shape.scaleZ || 1, { min: 0.1, step: 0.1 });
        // Position inputs
        this.addFormRow(inspector, 'X Position', 'number', 'x', shape.x || 0, { step: 0.1 });
        this.addFormRow(inspector, 'Y Position', 'number', 'y', shape.y || 0, { step: 0.1 });
        this.addFormRow(inspector, 'Z Position', 'number', 'z', shape.z || 0, { step: 0.1 });
        
        // Rotation inputs
        this.addFormRow(inspector, 'X Rotation', 'number', 'rotationX', shape.rotationX || 0, { step: 1 });
        this.addFormRow(inspector, 'Y Rotation', 'number', 'rotationY', shape.rotationY || 0, { step: 1 });
        this.addFormRow(inspector, 'Z Rotation', 'number', 'rotationZ', shape.rotationZ || 0, { step: 1 });
        
        // Size inputs
        if (['cube', 'sphere', 'tetrahedron', 'torus'].includes(shape.type)) {
            this.addFormRow(inspector, 'Size', 'number', 'size', shape.size || 2, { min: 0.1, step: 0.1 });
        }
        
        if (shape.type === 'box') {
            this.addFormRow(inspector, 'Width', 'number', 'width', shape.width || 2, { min: 0.1, step: 0.1 });
            this.addFormRow(inspector, 'Height', 'number', 'height', shape.height || 2, { min: 0.1, step: 0.1 });
            this.addFormRow(inspector, 'Depth', 'number', 'depth', shape.depth || 2, { min: 0.1, step: 0.1 });
        }
        
        if (['cylinder', 'cone'].includes(shape.type)) {
            this.addFormRow(inspector, 'Size', 'number', 'size', shape.size || 2, { min: 0.1, step: 0.1 });
            this.addFormRow(inspector, 'Height', 'number', 'height', shape.height || 3, { min: 0.1, step: 0.1 });
        }
        
        if (shape.type === 'torus') {
            this.addFormRow(inspector, 'Tube Size', 'number', 'tubeSize', shape.tubeSize || shape.size / 6, { min: 0.1, step: 0.1 });
        }
    }


    addFormRow(container, label, type, property, value, options = {}) {
        const row = document.createElement('div');
        row.className = 'form-row';
        
        const labelElement = document.createElement('label');
        labelElement.textContent = label;
        row.appendChild(labelElement);
        
        let input;
        
        if (type === 'select') {
            input = document.createElement('select');
            input.setAttribute('data-property', property);
            (options.options || []).forEach(optionValue => {
                const option = document.createElement('option');
                option.value = optionValue;
                option.textContent = optionValue;
                if (value === optionValue) {
                    option.selected = true;
                }
                input.appendChild(option);
            });
        } else if(type === "color") {
            input = this.gameEditor.createColorInputGroup(value, 'data-property', property, row, (val, colorName) => {
                if(colorName){
                    this.graphicsEditor.getFrameShape()[property] = { paletteColor: colorName };
                } else {
                    this.graphicsEditor.getFrameShape()[property] = val;
                }
                this.graphicsEditor.refreshShapes(false);
            });            
        } else if(type === "texture") {
            input = this.gameEditor.createTextureInputGroup(value, 'data-property', property, row, (val) => {
                if(val){
                    this.graphicsEditor.getFrameShape()[property] = val;
                }
                this.graphicsEditor.refreshShapes(false);
            });            
        } else if(type === "file") {
            let inputContainer = document.createElement('div');
            inputContainer.style = "flex: 1; display: flex; flex-direction: column; font-size: .75em;";
            input = document.createElement('input');
            input.style = "width: calc(100% - 18px);"
            input.type = type;
            input.setAttribute('data-property', property);
            inputContainer.appendChild(input);
            if( value ) {
                let urlName = document.createElement('span');
                urlName.innerText = value;            
                inputContainer.appendChild(urlName);
            }
            row.appendChild(inputContainer);
            container.appendChild(row);
            input.addEventListener('change', options.change );
            return input;
        } else {
            input = document.createElement('input');
            input.type = type;
            input.value = value;
            input.setAttribute('data-property', property);
            
            if (type === 'number') {
                if(options.min != undefined) input.min = options.min;
                if(options.max != undefined) input.max = options.max;
                input.step = options.step || 1;
            }
        }
        
        input.addEventListener('change', options.change || ((e) => {
            let newValue = e.target.value;
            if (type === 'number') {
                newValue = parseFloat(newValue);
                // If we're editing a transform property, also update the transform target
                if (this.graphicsEditor.shapeManager.currentTransformTarget && ['x', 'y', 'z', 'rotationX', 'rotationY', 'rotationZ', 'scaleX', 'scaleY', 'scaleZ'].includes(property)) {
                    if (property === 'x') this.graphicsEditor.shapeManager.currentTransformTarget.position.x = newValue;
                    if (property === 'y') this.graphicsEditor.shapeManager.currentTransformTarget.position.y = newValue;
                    if (property === 'z') this.graphicsEditor.shapeManager.currentTransformTarget.position.z = newValue;
                    
                    if (property === 'rotationX') this.graphicsEditor.shapeManager.currentTransformTarget.rotation.x = newValue;
                    if (property === 'rotationY') this.graphicsEditor.shapeManager.currentTransformTarget.rotation.y = newValue;
                    if (property === 'rotationZ') this.graphicsEditor.shapeManager.currentTransformTarget.rotation.z = newValue;
                    
                    if (property === 'scaleX') this.graphicsEditor.shapeManager.currentTransformTarget.scale.x = newValue;
                    if (property === 'scaleY') this.graphicsEditor.shapeManager.currentTransformTarget.scale.y = newValue;
                    if (property === 'scaleZ') this.graphicsEditor.shapeManager.currentTransformTarget.scale.z = newValue;
                    
                    // Update gizmo position after directly changing values
                }
            } else if(type === 'file') {
                return;
            }
            
            this.updatePropertyValue(property, newValue);
            this.graphicsEditor.refreshShapes(false);
        }));
        
        row.appendChild(input);
        container.appendChild(row);
        return input;
    }

    readTransformData(objData, property, value){
        // Handle transform properties
        if (property.startsWith('scale')) {
            if(!objData.scale) objData.scale = {};
            const axis = property.charAt(property.length - 1).toLowerCase();
            if(Number(value) != 1){
                objData.scale[axis] = value;
            } else {
                delete objData.scale[axis];
                if(Object.keys(objData.scale).length == 0) delete objData.scale;
            }
        } else if (property.startsWith('rotation')) {
            if(!objData.rotation) objData.rotation = {};
            const axis = property.charAt(property.length - 1).toLowerCase();
            if(Number(value) != 0){
                objData.rotation[axis] = value;
            } else {
                delete objData.rotation[axis];
                if(Object.keys(objData.rotation).length == 0) delete objData.rotation;
            }            
        } else if (['x', 'y', 'z'].includes(property)) {
            if(!objData.position) objData.position = {};
            const axis = property;
            if(Number(value) != 0){
                objData.position[axis] = value;
            } else {
                delete objData.position[axis];
                if(Object.keys(objData.position).length == 0) delete objData.position;
            }
        }
        delete objData[property];
    }

    updatePropertyValue(property, value) {
        const shapeData = this.graphicsEditor.getFrameShape();
        if (shapeData) {
            // Handle transform properties            
            this.readTransformData(shapeData, property, value);
        } else {
            let groupData = this.graphicsEditor.getCurrentGroup();
            if(!groupData){
                groupData = {};
                let currentFrame = this.graphicsEditor.getCurrentFrame();
                if(currentFrame) {
                    currentFrame[this.graphicsEditor.state.currentGroup] = groupData;
                }
            }                    
            this.readTransformData(groupData, property, value);
        }
    }

    updateList() {
        const frameList = document.getElementById('frame-list');
        frameList.innerHTML = '';
        const groupList = document.getElementById('group-list');
        groupList.innerHTML = '';
        const shapeList = document.getElementById('shape-list');
        shapeList.innerHTML = '';
        this.updateFrameList();
        this.graphicsEditor.groupManager.updateGroupList();
        this.updateShapeList();
    }

    updateFrameList() {
        const list = document.getElementById('frame-list');
        // Animation selector
        const animSelector = document.createElement('select');
        animSelector.style.marginBottom = '10px';

        const option = document.createElement('option');
        option.value = '__model__';
        option.textContent = 'model';
        if (this.graphicsEditor.state.editingModel) option.selected = true;
        animSelector.appendChild(option);


        Object.keys(this.graphicsEditor.state.renderData.animations).forEach(anim => {
            const option = document.createElement('option');
            option.value = anim;
            option.textContent = anim;
            if (anim === this.graphicsEditor.state.currentAnimation) option.selected = true;
            animSelector.appendChild(option);
        });
        animSelector.addEventListener('change', (e) => {
            this.graphicsEditor.setPreviewAnimationState(false);
            if(e.target.value == '__model__'){
                this.graphicsEditor.state.editingModel = true;
                this.graphicsEditor.state.currentAnimation = "";                
            } else {
                this.graphicsEditor.state.editingModel = false;
                this.graphicsEditor.state.currentAnimation = animSelector.value;                
            }
            this.graphicsEditor.state.currentFrame = 0;
            this.graphicsEditor.refreshShapes(false);
            requestAnimationFrame(() => {
                this.graphicsEditor.state.selectedShapeIndex = -1;
                this.graphicsEditor.shapeManager.selectShape(0);
            })
        });
        list.appendChild(animSelector);
        if(this.graphicsEditor.state.editingModel) return;
        // Frame list
        const frameList = document.createElement('div');
        frameList.style.marginBottom = '10px';
        this.graphicsEditor.getCurrentAnimation().forEach((frame, index) => {
            const frameItem = document.createElement('div');
            frameItem.textContent = `Frame ${index + 1}`;
            frameItem.style.padding = '5px';
            frameItem.style.cursor = 'pointer';
            if (index === this.graphicsEditor.state.currentFrame) frameItem.style.backgroundColor = '#555';
            frameItem.addEventListener('click', () => {
                this.graphicsEditor.setPreviewAnimationState(false);
                this.graphicsEditor.state.currentFrame = index;  
                this.graphicsEditor.refreshShapes(false);
                requestAnimationFrame(() => {  
                    this.graphicsEditor.state.selectedShapeIndex = -1;
                    this.graphicsEditor.shapeManager.selectShape(0);
                })
            });
            frameList.appendChild(frameItem);
        });
        list.appendChild(frameList);
    }


    updateShapeList() {
        const list = document.getElementById('shape-list');
        if (!list) return;
        

        // Get shapes from the currently selected group
        const currentGroup = this.graphicsEditor.state.currentGroup;
        const selectedGroup = this.graphicsEditor.getMergedGroup(currentGroup);
        const shapes = selectedGroup && selectedGroup.shapes ? selectedGroup.shapes : selectedGroup || [];
       
        // Create shape list items
        for (let i = 0; i < shapes.length; i++) {
            const shape = shapes[i];
            if (!shape) continue;
           
            const shapeItem = document.createElement('div');
            shapeItem.classList.add('shape-item');
           
            // Mark as selected if this shape is the selected one and we're in the right group
            if (i === this.graphicsEditor.state.selectedShapeIndex) {
                shapeItem.classList.add('selected');
            }
           
            shapeItem.textContent = `${shape.name} - ${shape.type || 'Shape'}`;
            shapeItem.addEventListener('click', (e) => {               
                this.graphicsEditor.shapeManager.selectShape(parseInt(e.target.dataset.index));
            });
           
            // Make the shape draggable
            shapeItem.draggable = true;
            shapeItem.dataset.index = i;
            shapeItem.dataset.group = currentGroup;
            
            // Add dragstart event to set the drag data
            shapeItem.addEventListener('dragstart', (e) => {
                // Store only the selected shape's index and source group
                const data = {
                    shapeIndex: i,
                    sourceGroup: currentGroup
                };
                
                // Set the drag data
                e.dataTransfer.setData('text/plain', JSON.stringify(data));
                
                // Add a visual indicator
                shapeItem.classList.add('dragging');
                
                // Set drag effect
                e.dataTransfer.effectAllowed = 'move';
            });
            
            // Add dragend event to clean up
            shapeItem.addEventListener('dragend', () => {
                shapeItem.classList.remove('dragging');
            });
           
            list.appendChild(shapeItem);
        }
        
        // Set up the shape list container as a drop target
        list.addEventListener('dragover', (e) => {
            // Only respond if we're dragging over the shape list itself, not an individual shape
            if (e.target === list) {
                e.preventDefault();
                e.dataTransfer.dropEffect = 'move';
                list.classList.add('drag-over');
            }
        });
        
        list.addEventListener('dragleave', (e) => {
            // Only respond if we're leaving the shape list
            if (e.target === list) {
                list.classList.remove('drag-over');
            }
        });
        
        list.addEventListener('drop', (e) => {
            e.preventDefault();
            list.classList.remove('drag-over');
            
            const data = e.dataTransfer.getData('text/plain');
            if (!data) return;
            
            try {
                const dragData = JSON.parse(data);
                const { shapeIndex, sourceGroup } = dragData;
                
                // Only process if this is a different group
                if (sourceGroup && sourceGroup !== currentGroup) {
                    this.graphicsEditor.groupManager.moveToGroup(
                        parseInt(shapeIndex),
                        sourceGroup,
                        currentGroup
                    );
                }
            } catch (err) {
                console.error('Error processing drop in shape list:', err);
            }
        });
    }

}

ModelManager.script:
class ModelManager {
    constructor(app, config, { ShapeFactory, palette, textures }) {
        this.app = app;
        this.config = config;
        this.models = {};
        this.shapeFactory = new ShapeFactory(palette, textures, null);
        if(location.hostname.indexOf('github') >= 0) {
            this.shapeFactory.setURLRoot("/GUTS/");
        }
        this.textureAtlases = new Map();
        this.uvMappings = new Map();
        this.mergedGeometries = new Map();
        this.assetsLoaded = false;
    }

    clear() {
        this.models = {};
        this.uvMappings.clear();
        this.mergedGeometries.clear();
        this.textureAtlases.clear();
    }

    dispose() {
        for (const [key, model] of Object.entries(this.models)) {
            this.disposeModel(model);
        }
        this.models = {};
        this.uvMappings.clear();
        this.mergedGeometries.clear();
        this.textureAtlases.clear();
    }

    disposeModel(model) {
        if (!model) return;
        if (model.animations) {
            for (const [animType, frames] of Object.entries(model.animations)) {
                for (const frame of frames) {
                    if (frame.group) {
                        this.shapeFactory.disposeObject(frame.group);
                        frame.group = null;
                    }
                }
            }
        }
    }

    async loadModels(prefix, config) {
        if (!prefix || !config || typeof config !== 'object') {
            throw new Error('Invalid prefix or config provided to loadModels');
        }

        const textures = [];
        const textureInfo = [];

        // First pass: Load temporary models to collect textures
        const tempModels = [];
        for (const [type, cfg] of Object.entries(config)) {
            if (cfg.render && cfg.render.model) {
                const modelGroupName = Object.keys(cfg.render.model)[0];
                const modelGroup = cfg.render.model[modelGroupName];
                const isGLTF = modelGroup.shapes.length > 0 && modelGroup.shapes[0].type === "gltf";
                if (isGLTF) {
                    const modelKey = `${prefix}_${type}`;
                    const model = await this.createModel(prefix, type, cfg.render.model, false);
                    tempModels.push({ modelKey, model, spawnType: type });
                }
            }
        }

        // Collect textures
        tempModels.forEach(({ modelKey, model, spawnType }) => {
            let meshIndex = 0;
            model.traverse(child => {
                if (child.isMesh && child.material.map) {
                    textures.push(child.material.map);                    
                    textureInfo.push({ modelKey, spawnType, meshIndex });
                    meshIndex++;
                }
            });
        });

        // Generate texture atlas if textures exist
        if (textures.length > 0) {
            await this.generateTextureAtlas(prefix, textures, textureInfo);
        }

        // Second pass: Create final models with atlas and remapped UVs
        for (const [type, cfg] of Object.entries(config)) {
            if (cfg.render && cfg.render.model) {
                const modelGroupName = Object.keys(cfg.render.model)[0];
                const modelGroup = cfg.render.model[modelGroupName];
                const isGLTF = modelGroup.shapes.length > 0 && modelGroup.shapes[0].type === "gltf";
                if (isGLTF) {
                    const modelKey = `${prefix}_${type}`;
                    this.models[modelKey] = await this.createModel(prefix, type, cfg.render.model, true);
                    const animations = cfg.render.animations;
                    if (animations) {
                        await Promise.all(Object.keys(animations).map(async (animationName) => {
                            let mergedModel = JSON.parse(JSON.stringify(cfg.render.model));
                            let animMainGroup = mergedModel[Object.keys(mergedModel)[0]]; 
                            const anim = animations[animationName][0];                            
                            if (anim && Object.keys(anim).length > 0){;
                                animMainGroup = anim[Object.keys(anim)[0]];                                
                            }
                            if (!animMainGroup) return;
                            
                            if (animMainGroup && animMainGroup.shapes && animMainGroup.shapes[0] && animMainGroup.shapes[0].url) {
                                mergedModel[modelGroupName].shapes[0].url = `${animMainGroup.shapes[0].url}`;
                            }
                            const modelKey = `${prefix}_${type}_${animationName}`;
                            this.models[modelKey] = await this.createModel(prefix, type, mergedModel, true);
                        }));
                    }
                } else {
                    this.models[`${prefix}_${type}`] = await this.createModel(prefix, type, cfg.render.model, false);
                  
                }
            }
        }  

        // Dispose temporary models
        tempModels.forEach(({ model }) => this.shapeFactory.disposeObject(model));

        this.assetsLoaded = true;
    }

    async generateTextureAtlas(objectType, textures, textureInfo) {
        const textureSizes = textures.map((texture) => {
            const img = texture.image;
            return { width: img.width, height: img.height };
        });

        const gridSize = Math.ceil(Math.sqrt(textures.length));
        let maxWidth = 0;
        let maxHeight = 0;
        const gridPositions = [];

        textureSizes.forEach((size, i) => {
            const row = Math.floor(i / gridSize);
            const col = i % gridSize;
            const x = col * Math.max(...textureSizes.map(s => s.width));
            const y = row * Math.max(...textureSizes.map(s => s.height));
            gridPositions.push({ x, y });
            maxWidth = Math.max(maxWidth, x + size.width);
            maxHeight = Math.max(maxHeight, y + size.height);
        });

        let atlasWidth = Math.pow(2, Math.ceil(Math.log2(maxWidth)));
        let atlasHeight = Math.pow(2, Math.ceil(Math.log2(maxHeight)));

        const maxTextureSize = 4096;
        let scale = 1;
        if (atlasWidth > maxTextureSize || atlasHeight > maxTextureSize) {
            console.warn('Atlas size exceeds GPU limit. Scaling down textures.');
            scale = Math.min(maxTextureSize / atlasWidth, maxTextureSize / atlasHeight);
            maxWidth = Math.floor(maxWidth * scale);
            maxHeight = Math.floor(maxHeight * scale);
            atlasWidth = Math.pow(2, Math.ceil(Math.log2(maxWidth)));
            atlasHeight = Math.pow(2, Math.ceil(Math.log2(maxHeight)));
            textureSizes.forEach(size => {
                size.width = Math.floor(size.width * scale);
                size.height = Math.floor(size.height * scale);
            });
            gridPositions.forEach(pos => {
                pos.x = Math.floor(pos.x * scale);
                pos.y = Math.floor(pos.y * scale);
            });
        }

        const canvas = document.createElement('canvas');
        canvas.width = atlasWidth;
        canvas.height = atlasHeight;
        const ctx = canvas.getContext('2d');

        this.uvMappings.clear();
        textures.forEach((texture, i) => {
            const img = texture.image;
            const size = textureSizes[i];
            const pos = gridPositions[i];
            ctx.drawImage(img, pos.x, pos.y, size.width, size.height);
            this.uvMappings.set(`${textureInfo[i].spawnType}_${textureInfo[i].meshIndex}`, [
                pos.x / atlasWidth,
                pos.y / atlasHeight,
                (pos.x + size.width) / atlasWidth,
                (pos.y + size.height) / atlasHeight
            ]);
        });
        this.textureAtlases[objectType] = new THREE.CanvasTexture(canvas);
        this.textureAtlases[objectType].flipY = false;
        this.textureAtlases[objectType].colorSpace = THREE.SRGBColorSpace;
        this.textureAtlases[objectType].needsUpdate = true;
    }

    async createModel(objectType, spawnType, modelData, useAtlas = true) {
        const modelGroup = await this.createObjectsFromJSON(modelData, {}, objectType, spawnType);
        if (modelGroup) {
            let meshIndex = 0;
            modelGroup.traverse((child) => {
                if (child.isMesh) {
                    child.castShadow = true;
                    child.receiveShadow = true;
                    const geometry = child.geometry;
                    if (useAtlas && this.textureAtlases[objectType] && this.uvMappings.has(`${spawnType}_${meshIndex}`) && !geometry.userData.uvsRemapped) {
                        geometry.userData.uvsRemapped = true;
                        // Apply texture atlas material
                        child.material = new THREE.MeshStandardMaterial({
                            map: this.textureAtlases[objectType],
                            metalness: child.material.metalness || 0.5,
                            roughness: child.material.roughness || 0.5
                        });
                        child.material.needsUpdate = true;
                        // Remap UVs
                        const uvMapping = this.uvMappings.get(`${spawnType}_${meshIndex}`);
                        meshIndex++;
                        const [uMin, vMin, uMax, vMax] = uvMapping;
                        const uvAttribute = geometry.attributes.uv;
                        if (uvAttribute) {                   
                            for (let i = 0; i < uvAttribute.count; i++) {
                                let u = uvAttribute.getX(i);
                                let v = uvAttribute.getY(i);
                                // Map UVs to atlas region
                                const uNew = uMin + u * (uMax - uMin);
                                // Flip v to match GLTF (bottom-left) if atlas is top-left
                                const vNew = vMin + v * (vMax - vMin);                              
                                uvAttribute.setXY(i, uNew, vNew);
                            }
                            uvAttribute.needsUpdate = true;
                        }
                    }
                }
            });
        }
        return modelGroup;
    }

    // Updated getModel to create fresh instances
    // Use a more efficient approach: deep clone the prebuilt models
// This maintains the correct UV mapping and materials
getModel(prefix, type) {
  
    const modelKey = `${prefix}_${type}`;
    const masterModel = this.models[modelKey];
    
    if (!masterModel) {
        console.error(`Model not found for ${modelKey}`);
        return null;
    }
    
    // Create a properly cloned model with correct materials and geometries
    let model = this.deepCloneModel(masterModel);
    return model;
}

getAnimation(prefix, type, anim) {
    const modelKey = `${prefix}_${type}_${anim}`;
    const masterModel = this.models[modelKey];
    
    if (!masterModel) {
        console.error(`Animation model not found for ${modelKey}`);
        return null;
    }
    
    // Create a properly cloned model with correct materials and geometries
    let model = this.deepCloneModel(masterModel);
    return model;
}

// Helper method to properly clone a THREE.js model with all its properties
deepCloneModel(sourceRoot) {
    // Create a new root group to hold all cloned children
    const clonedRoot = new THREE.Group();
    clonedRoot.name = sourceRoot.name;
    clonedRoot.position.copy(sourceRoot.position);
    clonedRoot.quaternion.copy(sourceRoot.quaternion);
    clonedRoot.scale.copy(sourceRoot.scale);
    clonedRoot.userData = this.safeCloneUserData(sourceRoot.userData || {});

    // Clone all children of the sourceRoot
    sourceRoot.children.forEach(sourceModel => {
        const clonedModel = new THREE.Group();
        clonedModel.name = sourceModel.name;
        clonedModel.position.copy(sourceModel.position);
        clonedModel.quaternion.copy(sourceModel.quaternion);
        clonedModel.scale.copy(sourceModel.scale);
        clonedModel.userData = this.safeCloneUserData(sourceModel.userData || {});

        // Clone children of the current sourceModel
        sourceModel.children.forEach(child => {
            const clonedChild = this.cloneObject3D(child);
            if (clonedChild) {
                clonedModel.add(clonedChild);
            }

            // Handle animations for this child if it has them
            if (clonedChild.userData.isGLTFRoot && clonedChild.userData.animations && clonedChild.userData.animations.length > 0) {
                // Create a map of original bone UUIDs to cloned bones
                const boneMap = new Map();
                sourceModel.traverse(src => {
                    if (src.isBone) {
                        clonedChild.traverse(cloned => {
                            if (cloned.isBone && cloned.name === src.name) {
                                boneMap.set(src.uuid, cloned);
                            }
                        });
                    }
                });

                // Remap AnimationClip tracks to cloned bones
                clonedChild.userData.animations = clonedChild.userData.animations.map(clip => {
                    const newTracks = clip.tracks.map(track => {
                        const [uuid, property] = track.name.split('.');
                        const newBone = boneMap.get(uuid);
                        if (newBone) {
                            return new THREE[track.constructor.name](`${newBone.uuid}.${property}`, track.times, track.values);
                        }
                        return track;
                    });
                    return new THREE.AnimationClip(clip.name, clip.duration, newTracks);
                });

                // Create new AnimationMixer
                const mixer = new THREE.AnimationMixer(clonedChild);
                const action = mixer.clipAction(clonedChild.userData.animations[0]);
                clonedChild.userData.mixer = mixer;
                clonedChild.userData.action = action;
            } 
        });

        // Add the cloned model to the root
        clonedRoot.add(clonedModel);
    });

    return clonedRoot;
}

cloneObject3D(source) {
  if (!source) return null;

  let cloned;

  if (source.isSkinnedMesh) {
    // Clone geometry and material
    const geometry = source.geometry.clone();
    let material;
    if (Array.isArray(source.material)) {
      material = source.material.map(mat => mat.clone());
    } else {
      material = source.material.clone();
      if (material.map) {
        material.map = source.material.map; // Preserve texture atlas
        material.needsUpdate = true;
      }
    }

    // Create new SkinnedMesh
    cloned = new THREE.SkinnedMesh(geometry, material);

    // Clone skeleton and preserve bone hierarchy
    if (source.skeleton) {
      // Create a map to track cloned bones
      const boneMap = new Map();
      const clonedBones = [];

      // Clone bones and preserve hierarchy
      source.skeleton.bones.forEach(bone => {
        const clonedBone = bone.clone(false); // Clone without children
        boneMap.set(bone.uuid, clonedBone);
        clonedBones.push(clonedBone);
      });

      // Rebuild bone hierarchy
      source.skeleton.bones.forEach(bone => {
        const clonedBone = boneMap.get(bone.uuid);
        if (bone.parent && bone.parent.isBone) {
          const clonedParent = boneMap.get(bone.parent.uuid);
          if (clonedParent) {
            clonedParent.add(clonedBone);
          }
        } else {
          // Root bones are added to the SkinnedMesh or its parent group
          cloned.add(clonedBone);
        }
      });

      // Create new skeleton
      const clonedSkeleton = new THREE.Skeleton(clonedBones, source.skeleton.boneInverses.map(m => m.clone()));

      // Bind skeleton to the cloned mesh
      cloned.bind(clonedSkeleton, source.bindMatrix.clone());

      // Store skeleton in userData
      cloned.userData.skeleton = clonedSkeleton;
      console.log('Cloned SkinnedMesh with skeleton:', clonedSkeleton.bones.length, 'bones');
    }
  } else if (source.isMesh) {
    const geometry = source.geometry.clone();
    let material;
    if (Array.isArray(source.material)) {
      material = source.material.map(mat => mat.clone());
    } else {
      material = source.material.clone();
      if (material.map) {
        material.map = source.material.map;
        material.needsUpdate = true;
      }
    }
    cloned = new THREE.Mesh(geometry, material);
  } else if (source.isGroup) {
    cloned = new THREE.Group();
  } else {
    cloned = new THREE.Object3D();
  }

  // Copy common properties
  cloned.name = source.name;
  cloned.position.copy(source.position);
  cloned.quaternion.copy(source.quaternion);
  cloned.scale.copy(source.scale);
  cloned.castShadow = source.castShadow;
  cloned.receiveShadow = source.receiveShadow;

  // Clone userData
  cloned.userData = this.safeCloneUserData(source.userData || {});

  // Clone children recursively
  source.children.forEach(child => {
    const clonedChild = this.cloneObject3D(child);
    if (clonedChild) {
      cloned.add(clonedChild);
    }
  });

  return cloned;
}
safeCloneUserData(userData) {
  const result = {};

  for (const key in userData) {
    const value = userData[key];

    if (value === null || value === undefined) {
      result[key] = value;
    } else if (typeof value === 'number' || typeof value === 'string' || typeof value === 'boolean') {
      result[key] = value;
    } else if (value instanceof Array) {
      if (value.length > 0 && value[0] instanceof THREE.AnimationClip) {
        result[key] = value.map(clip => clip.clone());
      } else {
        result[key] = [...value];
      }
    } else if (typeof value === 'object') {
      if (key === 'mixer' || key === 'skeleton') {
        continue; // Skip mixer and skeleton
      }
      if (Object.getPrototypeOf(value) === Object.prototype) {
        result[key] = { ...value };
      } else if (typeof value.clone === 'function') {
        try {
          result[key] = value.clone();
        } catch (e) {
          console.warn(`Failed to clone userData property ${key}`, e);
        }
      }
    }
  }

  return result;
}
    async createObjectsFromJSON(model, frameData, objectType, spawnType) {
        const rootGroup = new THREE.Group();
        for (const groupName in model) {
            const group = await this.shapeFactory.createMergedGroupFromJSON(model, frameData, groupName, objectType, spawnType);
            if (group) {
                rootGroup.add(group);
            }
        }
        return rootGroup;
    }
}

