class TerrainImageProcessor {
  //Utility function to convert terrain tile spritesheets to and from base64 encoding
    constructor(app, options = {}) {
        this.app = app;
        // Configurable tile dimensions with defaults
        this.tileWidth = options.tileWidth || 24;
        this.tileHeight = options.tileHeight || 24;
        this.tilesX = options.tilesX || 4;
        this.tilesY = options.tilesY || 1;

        // Bind methods to ensure correct context
        this.convertCanvasToBase64Tiles = this.convertCanvasToBase64Tiles.bind(this);
        this.displayStoredBase64Tiles = this.displayStoredBase64Tiles.bind(this);

        // Element references
        this.output = null;
        this.displayImage = null;
    }

    // Initialize the processor with DOM elements
    initialize(outputElement, displayImageElement) {
        this.output = outputElement;
        this.displayImage = displayImageElement;

        // Optional: Add custom event listener
        document.body.addEventListener('editTerrainImage', this.displayStoredBase64Tiles);
    }

    processImage(imageUrl) {
        const img = new Image();
        img.onload = () => {
            // Create a temporary canvas to process the image
            const canvas = document.createElement('canvas');
            canvas.width = this.tileWidth * this.tilesX;
            canvas.height = this.tileHeight * this.tilesY;

            const ctx = canvas.getContext('2d');
            
            // Set transparent background
            ctx.globalCompositeOperation = 'source-over';
            ctx.clearRect(0, 0, canvas.width, canvas.height);
            
            // Draw the uploaded image, scaling to fit the canvas
            ctx.drawImage(img, 0, 0, canvas.width, canvas.height);

            // Convert to base64 tiles with vertical flips
            const base64Tiles = this.convertCanvasToBase64Tiles(canvas);
            
            // Save base64 tiles to output
            this.output.value = JSON.stringify(base64Tiles);

            // Display the original uploaded image
            this.displayImage.src = imageUrl;
        };
        img.src = imageUrl;
    }



    // Convert canvas to array of base64 tiles with vertical flips
    convertCanvasToBase64Tiles(canvas, format = 'png', quality = 1.0) {
        const base64Tiles = [];

        // First, process the first row of tiles normally
        for (let x = 0; x < this.tilesX; x++) {
            const tileCanvas = document.createElement('canvas');
            tileCanvas.width = this.tileWidth;
            tileCanvas.height = this.tileHeight;
            const tileCtx = tileCanvas.getContext('2d');

            // Calculate the source position on the main canvas
            const srcX = x * this.tileWidth;
            const srcY = 0;

            // Get the image data for this tile
            const imageData = canvas.getContext('2d').getImageData(
                srcX, srcY, this.tileWidth, this.tileHeight
            );

            // Put the image data on the tile canvas
            tileCtx.putImageData(imageData, 0, 0);

            // Convert the tile canvas to a data URL
            const dataUrl = tileCanvas.toDataURL(`image/${format}`, quality);

            // Extract the Base64 string (remove the prefix)
            const base64String = dataUrl.split(',')[1];

            // Add to the array
            base64Tiles.push(base64String);
        }

        // Now create vertically flipped versions of the first row
        for (let x = 0; x < this.tilesX; x++) {
            const tileCanvas = document.createElement('canvas');
            tileCanvas.width = this.tileWidth;
            tileCanvas.height = this.tileHeight;
            const tileCtx = tileCanvas.getContext('2d');

            // Calculate the source position on the main canvas
            const srcX = x * this.tileWidth;
            const srcY = 0;

            // Get the image data for this tile
            const imageData = canvas.getContext('2d').getImageData(
                srcX, srcY, this.tileWidth, this.tileHeight
            );

            // Create a new ImageData for the flipped tile
            const flippedImageData = new ImageData(this.tileWidth, this.tileHeight);
            for (let y = 0; y < this.tileHeight; y++) {
                for (let x = 0; x < this.tileWidth; x++) {
                    const srcIndex = (y * this.tileWidth + x) * 4;
                    const destIndex = ((this.tileHeight - 1 - y) * this.tileWidth + x) * 4;
                    
                    flippedImageData.data[destIndex] = imageData.data[srcIndex];     // R
                    flippedImageData.data[destIndex + 1] = imageData.data[srcIndex + 1]; // G
                    flippedImageData.data[destIndex + 2] = imageData.data[srcIndex + 2]; // B
                    flippedImageData.data[destIndex + 3] = imageData.data[srcIndex + 3]; // A
                }
            }

            // Put the flipped image data on the tile canvas
            tileCtx.putImageData(flippedImageData, 0, 0);

            // Convert the tile canvas to a data URL
            const dataUrl = tileCanvas.toDataURL(`image/${format}`, quality);

            // Extract the Base64 string (remove the prefix)
            const base64String = dataUrl.split(',')[1];

            // Add to the array
            base64Tiles.push(base64String);
        }

        return base64Tiles;
    }

    // Display stored base64 tiles
    displayStoredBase64Tiles() {
        // Check if there are stored base64 tiles
        if (!this.output.value) return;

        try {
            // Parse the stored base64 tiles
            const base64Tiles = JSON.parse(this.output.value);

            // Validate the number of tiles
            if (!Array.isArray(base64Tiles) || base64Tiles.length !== 8) {
                console.error('Invalid base64 tiles array');
                return;
            }

            const img = new Image();
            const canvas = document.createElement('canvas');
            canvas.width = this.tileWidth * this.tilesX;
            canvas.height = this.tileHeight * this.tilesY;
            const ctx = canvas.getContext('2d');

            let loadedImages = 0;
            const tileImages = new Array(8).fill(null);

            base64Tiles.forEach((base64String, index) => {
                const tileImg = new Image();
                tileImg.onload = () => {
                    tileImages[index] = tileImg;
                    loadedImages++;

                    // Once all images are loaded, draw them
                    if (loadedImages === base64Tiles.length) {
                        // Draw first row of tiles
                        for (let x = 0; x < this.tilesX; x++) {
                            ctx.drawImage(tileImages[x], x * this.tileWidth, 0);
                        }

                        // Set the final image
                        this.displayImage.src = canvas.toDataURL('image/png');
                    }
                };

                // Ensure the base64 string has the correct data URL prefix
                if (!base64String.startsWith('data:image/')) {
                    base64String = 'data:image/png;base64,' + base64String;
                }
                tileImg.src = base64String;
            });
        } catch (error) {
            console.error('Error parsing stored base64 tiles:', error);
        }
    }

    // Method to clean up event listeners if needed
    destroy() {
        document.body.removeEventListener('editTerrainImage', this.displayStoredBase64Tiles);
    }
}

TextureEditor.script:
class TextureEditor {
    constructor(gameEditor) {
        this.gameEditor = gameEditor;
        this.canvas = null;
        this.ctx = null;
        this.currentColor = '#000000FF'; // Added alpha component (FF = fully opaque)
        this.brushSize = 1;
        this.isDrawing = false;
        this.history = [];
        this.historyIndex = -1;
        this.colorPalette = [];
        if (this.gameEditor.getCollections().palettes && this.gameEditor.getCollections().configs.game.palette) {
            const palette = this.gameEditor.getCollections().palettes[this.gameEditor.getCollections().configs.game.palette];

            if (palette) {
                for(let key in palette) {
                    if(key.toLowerCase().endsWith('color')){
                        this.colorPalette.push(palette[key]);
                    }
                }
            }
        }
        this.activeTool = 'brush'; // Default active tool

        // Transparency checker pattern properties
        this.transparencyCheckerSize = 10;
        this.transparencyCheckerColors = ['#DDDDDD', '#FFFFFF'];

        // Zoom related properties
        this.zoomLevel = 1;
        this.maxZoomLevel = 16;
        this.minZoomLevel = 0.25;
        this.imageWidth = 0;
        this.imageHeight = 0;

        this.setupUI();
        this.setupEventListeners();
    }

    setupUI() {
        const container = document.getElementById('texture-editor-container');
        if (!container) return;

        // Setup color palette
        const paletteEl = container.querySelector('#color-palette');
        this.colorPalette.forEach(color => {
            const colorBtn = document.createElement('div');
            colorBtn.className = 'color-btn';
            colorBtn.style.backgroundColor = this.hexToRgbaString(color);
            colorBtn.dataset.color = color;
            paletteEl.appendChild(colorBtn);
        });

        // Initialize canvas
        this.canvas = document.getElementById('texture-canvas');
        this.ctx = this.canvas.getContext('2d', { willReadFrequently: true });

        // Set initial UI state
        document.getElementById('noTextureMessage').style.display = 'block';
        this.canvas.style.display = 'none';

        // Add zoom controls to the UI
        this.addZoomControls(container);
        // Create a container for the canvas if it doesn't exist
        let canvasContainer = this.canvas.parentElement;

        if (canvasContainer) {

            // Add transparency checker pattern background to container
            this.setupTransparencyChecker(canvasContainer);

        }
    }

    addZoomControls(container) {
        // Create zoom controls container
        const zoomControlsContainer = document.createElement('div');
        zoomControlsContainer.className = 'zoom-controls';
        zoomControlsContainer.style.display = 'flex';
        zoomControlsContainer.style.alignItems = 'center';
        zoomControlsContainer.style.marginTop = '10px';

        // Zoom out button
        const zoomOutBtn = document.createElement('button');
        zoomOutBtn.id = 'zoom-out-btn';
        zoomOutBtn.innerText = '-';
        zoomOutBtn.className = 'zoom-btn';

        // Zoom display
        const zoomDisplay = document.createElement('span');
        zoomDisplay.id = 'zoom-display';
        zoomDisplay.innerText = '100%';
        zoomDisplay.style.margin = '0 10px';

        // Zoom in button
        const zoomInBtn = document.createElement('button');
        zoomInBtn.id = 'zoom-in-btn';
        zoomInBtn.innerText = '+';
        zoomInBtn.className = 'zoom-btn';

        // Reset zoom button
        const resetZoomBtn = document.createElement('button');
        resetZoomBtn.id = 'reset-zoom-btn';
        resetZoomBtn.innerText = 'Reset Zoom';
        resetZoomBtn.className = 'zoom-btn';
        resetZoomBtn.style.marginLeft = '10px';

        // Dimensions display
        const dimensionsDisplay = document.createElement('span');
        dimensionsDisplay.id = 'dimensions-display';
        dimensionsDisplay.innerText = 'Dimensions: 0 x 0';
        dimensionsDisplay.style.marginLeft = '15px';

        // Add all controls to container
        zoomControlsContainer.appendChild(zoomOutBtn);
        zoomControlsContainer.appendChild(zoomDisplay);
        zoomControlsContainer.appendChild(zoomInBtn);
        zoomControlsContainer.appendChild(resetZoomBtn);
        zoomControlsContainer.appendChild(dimensionsDisplay);

        // Add container to the editor UI
        container.appendChild(zoomControlsContainer);
    }

    setupEventListeners() {
        const container = document.getElementById('texture-editor-container');
        if (!container) return;

        // Global events
        document.body.addEventListener('editTexture', (event) => {
            this.updateUIFromSettings(event.detail.data);
        });

        // Tool selection
        container.querySelectorAll('.tool-btn').forEach(btn => {
            btn.addEventListener('click', (e) => {
                container.querySelectorAll('.tool-btn').forEach(b => b.classList.remove('active'));
                e.target.classList.add('active');
                this.setActiveTool(e.target.id);
            });
        });

        // Brush size
        const brushSizeInput = container.querySelector('#brush-size');
        const brushSizeDisplay = container.querySelector('#brush-size-display');
        brushSizeInput.addEventListener('input', (e) => {
            this.brushSize = parseInt(e.target.value);
            brushSizeDisplay.textContent = `${this.brushSize}px`;
        });

        // Color palette
        container.querySelectorAll('.color-btn').forEach(btn => {
            btn.addEventListener('click', (e) => {
                container.querySelectorAll('.color-btn').forEach(b => b.classList.remove('active'));
                e.target.classList.add('active');
                this.currentColor = e.target.dataset.color;
                // Update both color and transparency inputs
                const colorValue = this.currentColor.substring(0, 7);
                const alphaValue = parseInt(this.currentColor.substring(7, 9), 16) || 255;

                container.querySelector('#custom-color-picker').value = colorValue;
                const transparencySlider = container.querySelector('#transparency-slider');
                if (transparencySlider) {
                    transparencySlider.value = alphaValue;
                    document.getElementById('transparency-display').textContent = 
                        `${Math.round((alphaValue / 255) * 100)}%`;
                }
            });
        });

        // Custom color picker
        const customColorPicker = container.querySelector('#custom-color-picker');
        customColorPicker.addEventListener('input', (e) => {
            // Preserve alpha when changing color
            const alpha = this.currentColor.substring(7, 9) || 'FF';
            this.currentColor = e.target.value + alpha;
            container.querySelectorAll('.color-btn').forEach(b => b.classList.remove('active'));
        });

        // Transparency slider
        const transparencySlider = container.querySelector('#transparency-slider');
        transparencySlider.addEventListener('input', (e) => {
            const alphaValue = parseInt(e.target.value);
            const alphaHex = alphaValue.toString(16).padStart(2, '0').toUpperCase();

            // Update alpha in the current color
            this.currentColor = this.currentColor.substring(0, 7) + alphaHex;

            // Update display
            document.getElementById('transparency-display').textContent = 
                `${Math.round((alphaValue / 255) * 100)}%`;
        });

        // Canvas drawing events
        this.canvas.addEventListener('mousedown', (e) => {
            if (e.button === 0) { // Left click                
                this.startDrawing(e);
            }
        });

        this.canvas.addEventListener('mousemove', (e) => {
            if (this.isDrawing) {
                this.draw(e);
            }
        });

        this.canvas.addEventListener('mouseup', (e) => {
            if (e.button === 0) { // Left click
                if (this.isDrawing) {
                    this.stopDrawing();
                }
            } 
        });

        this.canvas.addEventListener('mouseleave', () => {
            this.stopDrawing();
        });

        // Zoom with mouse wheel
        this.canvas.addEventListener('wheel', (e) => {
            e.preventDefault();

            // Calculate zoom point relative to canvas
            const rect = this.canvas.getBoundingClientRect();
            const mouseX = e.clientX - rect.left;
            const mouseY = e.clientY - rect.top;

            // Calculate zoom direction
            const zoomFactor = e.deltaY < 0 ? 1.1 : 0.9;

            // Calculate new zoom level
            let newZoom = this.zoomLevel * zoomFactor;

            // Constrain zoom level
            newZoom = Math.max(this.minZoomLevel, Math.min(this.maxZoomLevel, newZoom));

            // Calculate zoom point in image coordinates
            const imageX = mouseX / this.zoomLevel;
            const imageY = mouseY / this.zoomLevel;

            // Update zoom level
            this.zoomLevel = newZoom;            

            // Update display
            this.updateZoomDisplay();
            this.renderCanvas();
        });

        // Zoom control buttons
        container.querySelector('#zoom-in-btn').addEventListener('click', () => {
            this.zoom(1.25);
        });

        container.querySelector('#zoom-out-btn').addEventListener('click', () => {
            this.zoom(0.8);
        });

        container.querySelector('#reset-zoom-btn').addEventListener('click', () => {
            this.resetZoom();
        });

        // Action buttons
        container.querySelector('#new-btn').addEventListener('click', () => this.newImage());
        container.querySelector('#undo-btn').addEventListener('click', () => this.undo());
        container.querySelector('#redo-btn').addEventListener('click', () => this.redo());
        container.querySelector('#clear-btn').addEventListener('click', () => this.clear());
        container.querySelector('.export-btn').addEventListener('click', () => {
            this.saveTexture(this.getCurrentTexture());
        });

        // File upload
        container.querySelector('input[type="file"]').addEventListener('change', (e) => {
            this.handleImageUpload(e);
        });
    }

    zoom(factor) {
        // Calculate new zoom level
        let newZoom = this.zoomLevel * factor;

        // Constrain zoom level
        newZoom = Math.max(this.minZoomLevel, Math.min(this.maxZoomLevel, newZoom));

        // Calculate center point of the viewport
        const viewportWidth = this.canvas.clientWidth;
        const viewportHeight = this.canvas.clientHeight;
        const centerX = viewportWidth / 2;
        const centerY = viewportHeight / 2;

        // Calculate zoom point in image coordinates
        const imageX = centerX / this.zoomLevel;
        const imageY = centerY / this.zoomLevel;

        // Update zoom level
        this.zoomLevel = newZoom;

        // Update display
        this.updateZoomDisplay();
        this.renderCanvas();
        // Update canvas display size
        this.updateCanvasDisplaySize();
    }

    updateCanvasDisplaySize() {


        // Set the canvas display size based on zoom
        const displayWidth = Math.ceil(this.imageWidth * this.zoomLevel);
        const displayHeight = Math.ceil(this.imageHeight * this.zoomLevel);

        this.canvas.style.width = `${displayWidth}px`;
        this.canvas.style.height = `${displayHeight}px`;
        this.transparencyChecker.style.width = `${displayWidth}px`;
        this.transparencyChecker.style.height = `${displayHeight}px`;

        // Update the cursor based on the active tool
        this.canvas.style.cursor = this.getToolCursor();
    }

    setupTransparencyChecker(container) {
        const displayWidth = Math.ceil(this.imageWidth * this.zoomLevel);
        const displayHeight = Math.ceil(this.imageHeight * this.zoomLevel);
        // Create and add transparency checker background
        this.transparencyChecker = document.createElement('div');
        this.transparencyChecker.className = 'transparency-checker';
        this.transparencyChecker.style.position = 'absolute';
        this.transparencyChecker.style.top = '0';
        this.transparencyChecker.style.left = '0';
        this.transparencyChecker.style.bottom = '0';
        this.transparencyChecker.style.right = '0';        
        this.transparencyChecker.style.margin = 'auto';
        this.transparencyChecker.style.width = `${displayWidth}px`;
        this.transparencyChecker.style.height = `${displayHeight}px`;
        this.transparencyChecker.style.backgroundImage = 'linear-gradient(45deg, #ffffff10 25%, transparent 25%), linear-gradient(-45deg, #ffffff10 25%, transparent 25%), linear-gradient(45deg, transparent 75%, #ffffff10 75%), linear-gradient(-45deg, transparent 75%, #ffffff10 75%)';
        this.transparencyChecker.style.backgroundSize = '10px 10px';
        this.transparencyChecker.style.backgroundPosition = '0 0, 0 10px, 10px -10px, -10px 0px';
        this.transparencyChecker.style.pointerEvents = 'none'; // Make it non-interactive
        this.transparencyChecker.style.zIndex = '-1';

        container.appendChild(this.transparencyChecker);
    }

    resetZoom() {
        // Reset zoom level
        this.zoomLevel = 1;

        // Update display
        this.updateZoomDisplay();
        this.renderCanvas();
    }

    updateZoomDisplay() {
        const zoomDisplay = document.getElementById('zoom-display');
        if (zoomDisplay) {
            zoomDisplay.innerText = `${Math.round(this.zoomLevel * 100)}%`;
        }
    }

    getToolCursor() {
        switch (this.activeTool) {
            case 'brush': return 'crosshair';
            case 'eraser': return 'cell';
            case 'fill': return 'pointer';
            case 'eyedropper': return 'copy';
            default: return 'crosshair';
        }
    }

    setActiveTool(toolId) {
        switch (toolId) {
            case 'brush-tool':
                this.activeTool = 'brush';
                this.canvas.style.cursor = 'crosshair';
                break;
            case 'eraser-tool':
                this.activeTool = 'eraser';
                this.canvas.style.cursor = 'cell';
                break;
            case 'fill-tool':
                this.activeTool = 'fill';
                this.canvas.style.cursor = 'pointer';
                break;
            case 'eyedropper-tool':
                this.activeTool = 'eyedropper';
                this.canvas.style.cursor = 'copy';
                break;
            default:
                this.activeTool = 'brush';
                this.canvas.style.cursor = 'crosshair';
        }
    }

    updateUIFromSettings(imageSrc) {
        if (!imageSrc) {
            document.getElementById('noTextureMessage').style.display = 'block';
            this.canvas.style.display = 'none';
            return;
        }

        // Load image onto canvas
        const img = new Image();
        img.onload = () => {
            // Set canvas dimensions to match image dimensions
            this.imageWidth = img.width;
            this.imageHeight = img.height;

            // Update canvas size to match image size
            this.canvas.width = this.imageWidth;
            this.canvas.height = this.imageHeight;

            // Update dimensions display
            this.updateDimensionsDisplay();

            // Show canvas and hide message
            document.getElementById('noTextureMessage').style.display = 'none';
            this.canvas.style.display = 'block';

            // Draw image on canvas with proper alpha support
            this.ctx.clearRect(0, 0, this.canvas.width, this.canvas.height);
            this.ctx.drawImage(img, 0, 0, this.imageWidth, this.imageHeight);

            // Reset zoom
            this.resetZoom();

            // Save initial state to history
            this.saveToHistory();

            // Apply initial render
            this.renderCanvas();
        };
        img.src = imageSrc;
    }

    updateDimensionsDisplay() {
        const dimensionsDisplay = document.getElementById('dimensions-display');
        if (dimensionsDisplay) {
            dimensionsDisplay.innerText = `Dimensions: ${this.imageWidth} x ${this.imageHeight}`;
        }
    }

    renderCanvas() {
        // Store the current state
        const currentState = this.ctx.getImageData(0, 0, this.canvas.width, this.canvas.height);

        // Clear the canvas
        this.ctx.setTransform(1, 0, 0, 1, 0, 0);
        this.ctx.clearRect(0, 0, this.canvas.width, this.canvas.height);

        // Set up the transformation for zoom
        this.ctx.setTransform(
            this.zoomLevel, 0, 
            0, this.zoomLevel, 
            this.zoomLevel, 
            this.zoomLevel
        );

        // Draw the image data
        this.ctx.putImageData(currentState, 0, 0);

        // Reset the transformation for UI elements
        this.ctx.setTransform(1, 0, 0, 1, 0, 0);
    }

    startDrawing(e) {
        this.isDrawing = true;

        // Save state before drawing
        this.saveToHistory();

        const pos = this.getCanvasCoordinates(e);

        switch (this.activeTool) {
            case 'brush':
                this.drawPixel(pos.x, pos.y);
                break;
            case 'eraser':
                this.erasePixel(pos.x, pos.y);
                break;
            case 'fill':
                this.fillArea(pos.x, pos.y);
                break;
            case 'eyedropper':
                this.pickColor(pos.x, pos.y);
                break;
        }
    }

    draw(e) {
        if (!this.isDrawing) return;

        const pos = this.getCanvasCoordinates(e);

        switch (this.activeTool) {
            case 'brush':
                this.drawPixel(pos.x, pos.y);
                break;
            case 'eraser':
                this.erasePixel(pos.x, pos.y);
                break;
        }
    }

    stopDrawing() {
        this.isDrawing = false;
    }

    getCanvasCoordinates(e) {
        const rect = this.canvas.getBoundingClientRect();

        // Calculate the mouse position relative to the canvas
        const mouseX = e.clientX - rect.left;
        const mouseY = e.clientY - rect.top;

        // Convert to image coordinates considering zoom
        const x = Math.floor(mouseX / this.zoomLevel);
        const y = Math.floor(mouseY / this.zoomLevel);

        return { x, y };
    }

    drawPixel(x, y) {
        // Save current transform
        this.ctx.save();

        // Reset transform for accurate drawing
        this.ctx.setTransform(1, 0, 0, 1, 0, 0);

        // Use RGBA for colors with transparency
        this.ctx.fillStyle = this.hexToRgbaString(this.currentColor);

        if (this.brushSize === 1) {
            this.ctx.fillRect(x, y, 1, 1);
        } else {
            const offset = Math.floor(this.brushSize / 2);
            for (let i = -offset; i < this.brushSize - offset; i++) {
                for (let j = -offset; j < this.brushSize - offset; j++) {
                    const posX = x + i;
                    const posY = y + j;
                    if (posX >= 0 && posX < this.canvas.width && posY >= 0 && posY < this.canvas.height) {
                        this.ctx.fillRect(posX, posY, 1, 1);
                    }
                }
            }
        }

        // Restore transform
        this.ctx.restore();

        // Reapply zoom
        this.renderCanvas();
    }
    erasePixel(x, y) {
        // Save current transform
        this.ctx.save();

        // Reset transform for accurate erasing
        this.ctx.setTransform(1, 0, 0, 1, 0, 0);

        // Get current image data
        const imageData = this.ctx.getImageData(0, 0, this.canvas.width, this.canvas.height);
        const data = imageData.data;

        // Apply eraser to pixels
        if (this.brushSize === 1) {
            const index = (y * this.canvas.width + x) * 4;
            // Set all channels (RGB and Alpha) to 0 for full transparency
            data[index] = 0;     // R
            data[index + 1] = 0; // G
            data[index + 2] = 0; // B
            data[index + 3] = 0; // A
        } else {
            const offset = Math.floor(this.brushSize / 2);
            for (let i = -offset; i < this.brushSize - offset; i++) {
                for (let j = -offset; j < this.brushSize - offset; j++) {
                    const posX = x + i;
                    const posY = y + j;
                    if (posX >= 0 && posX < this.canvas.width && posY >= 0 && posY < this.canvas.height) {
                        const index = (posY * this.canvas.width + posX) * 4;
                        // Set all channels to 0
                        data[index] = 0;     // R
                        data[index + 1] = 0; // G
                        data[index + 2] = 0; // B
                        data[index + 3] = 0; // A
                    }
                }
            }
        }

        // Put the modified image data back
        this.ctx.putImageData(imageData, 0, 0);

        // Restore transform
        this.ctx.restore();

        // Reapply zoom
        this.renderCanvas();
    }

    fillArea(x, y) {
        if (x < 0 || x >= this.imageWidth || y < 0 || y >= this.imageHeight) {
            return; // Out of bounds
        }

        // Save current transform
        this.ctx.save();

        // Reset transform for accurate fill
        this.ctx.setTransform(1, 0, 0, 1, 0, 0);

        // Get the pixel color at the clicked position
        const imageData = this.ctx.getImageData(0, 0, this.canvas.width, this.canvas.height);
        const data = imageData.data;

        // Get the index of the clicked pixel
        const index = (y * this.canvas.width + x) * 4;
        const targetR = data[index];
        const targetG = data[index + 1];
        const targetB = data[index + 2];
        const targetA = data[index + 3];

        // Don't fill if clicking on the same color
        const fillColor = this.hexToRgba(this.currentColor);
        if (targetR === fillColor.r && targetG === fillColor.g && targetB === fillColor.b && targetA === fillColor.a) {
            this.ctx.restore();
            return;
        }

        // Flood fill algorithm
        const stack = [{x, y}];
        const visited = new Set();

        while (stack.length > 0) {
            const pixel = stack.pop();
            const px = pixel.x;
            const py = pixel.y;

            // Skip if outside canvas or already visited
            if (px < 0 || px >= this.canvas.width || py < 0 || py >= this.canvas.height ||
                visited.has(`${px},${py}`)) {
                continue;
            }

            // Get current pixel index
            const currentIndex = (py * this.canvas.width + px) * 4;

            // Check if the pixel has the target color
            if (data[currentIndex] === targetR && 
                data[currentIndex + 1] === targetG && 
                data[currentIndex + 2] === targetB && 
                data[currentIndex + 3] === targetA) {

                // Set the new color
                data[currentIndex] = fillColor.r;
                data[currentIndex + 1] = fillColor.g;
                data[currentIndex + 2] = fillColor.b;
                data[currentIndex + 3] = fillColor.a;

                // Mark as visited
                visited.add(`${px},${py}`);

                // Add neighbors to stack
                stack.push({x: px + 1, y: py});
                stack.push({x: px - 1, y: py});
                stack.push({x: px, y: py + 1});
                stack.push({x: px, y: py - 1});
            }
        }

        // Update the canvas with the new image data
        this.ctx.putImageData(imageData, 0, 0);

        // Restore transform
        this.ctx.restore();

        // Reapply zoom
        this.renderCanvas();
    }

    pickColor(x, y) {
        if (x < 0 || x >= this.imageWidth || y < 0 || y >= this.imageHeight) {
            return; // Out of bounds
        }

        // Save current transform
        this.ctx.save();

        // Reset transform for accurate color picking
        this.ctx.setTransform(1, 0, 0, 1, 0, 0);

        const pixel = this.ctx.getImageData(x, y, 1, 1).data;

        // Create hex color including alpha
        const hexColor = `#${pixel[0].toString(16).padStart(2, '0')}${pixel[1].toString(16).padStart(2, '0')}${pixel[2].toString(16).padStart(2, '0')}${pixel[3].toString(16).padStart(2, '0')}`;

        this.currentColor = hexColor;

        // Update UI to show selected color
        const customColorPicker = document.querySelector('#custom-color-picker');
        if (customColorPicker) {
            customColorPicker.value = hexColor.substring(0, 7);
        }

        // Update transparency slider
        const transparencySlider = document.querySelector('#transparency-slider');
        if (transparencySlider) {
            transparencySlider.value = pixel[3];
            document.getElementById('transparency-display').textContent = 
                `${Math.round((pixel[3] / 255) * 100)}%`;
        }

        // Deselect any color in the palette
        document.querySelectorAll('.color-btn').forEach(btn => {
            btn.classList.remove('active');
            if (btn.dataset.color === hexColor) {
                btn.classList.add('active');
            }
        });

        // Restore transform
        this.ctx.restore();
    }

    hexToRgba(hex) {
        const r = parseInt(hex.slice(1, 3), 16);
        const g = parseInt(hex.slice(3, 5), 16);
        const b = parseInt(hex.slice(5, 7), 16);
        const a = parseInt(hex.slice(7, 9) || 'FF', 16);
        return { r, g, b, a };
    }

    hexToRgbaString(hex) {
        const { r, g, b, a } = this.hexToRgba(hex);
        return `rgba(${r}, ${g}, ${b}, ${a / 255})`;
    }

    saveToHistory() {
        // Trim history if we're not at the end
        if (this.historyIndex < this.history.length - 1) {
            this.history = this.history.slice(0, this.historyIndex + 1);
        }

        // Save current state - we need to reset transform to get the actual image data
        this.ctx.save();
        this.ctx.setTransform(1, 0, 0, 1, 0, 0);
        const imageData = this.ctx.getImageData(0, 0, this.canvas.width, this.canvas.height);
        this.ctx.restore();

        // Save to history
        this.history.push(imageData);
        this.historyIndex = this.history.length - 1;

        // Update undo/redo buttons
        this.updateUndoRedoButtons();
    }

    updateUndoRedoButtons() {
        const undoBtn = document.getElementById('undo-btn');
        const redoBtn = document.getElementById('redo-btn');

        if (undoBtn) {
            undoBtn.disabled = this.historyIndex <= 0;
        }

        if (redoBtn) {
            redoBtn.disabled = this.historyIndex >= this.history.length - 1;
        }
    }

    newImage() {
        // Prompt user for dimensions
        const width = prompt('Enter width for new texture (1-2048):', '64');
        const height = prompt('Enter height for new texture (1-2048):', '64');

        // Validate input
        const newWidth = parseInt(width);
        const newHeight = parseInt(height);

        if (isNaN(newWidth) || isNaN(newHeight) || newWidth < 1 || newWidth > 2048 || newHeight < 1 || newHeight > 2048) {
            alert('Invalid dimensions. Please enter values between 1 and 2048.');
            return;
        }

        // Save current state before creating a new texture
        this.saveToHistory();

        // Set canvas dimensions
        this.imageWidth = newWidth;
        this.imageHeight = newHeight;
        this.canvas.width = this.imageWidth;
        this.canvas.height = this.imageHeight;

        // Clear canvas with full transparency
        this.ctx.setTransform(1, 0, 0, 1, 0, 0);
        this.ctx.clearRect(0, 0, this.canvas.width, this.canvas.height);

        // Update dimensions display
        this.updateDimensionsDisplay();

        // Show canvas and hide no texture message
        document.getElementById('noTextureMessage').style.display = 'none';
        this.canvas.style.display = 'block';

        // Reset zoom
        this.resetZoom();

        // Save initial state to history
        this.saveToHistory();

        // Render canvas with zoom
        this.renderCanvas();
    }

    undo() {
        if (this.historyIndex > 0) {
            this.historyIndex--;

            // Reset transform to apply image data
            this.ctx.setTransform(1, 0, 0, 1, 0, 0);
            this.ctx.putImageData(this.history[this.historyIndex], 0, 0);

            // Update buttons and rerender
            this.updateUndoRedoButtons();
            this.renderCanvas();
        }
    }

    redo() {
        if (this.historyIndex < this.history.length - 1) {
            this.historyIndex++;

            // Reset transform to apply image data
            this.ctx.setTransform(1, 0, 0, 1, 0, 0);
            this.ctx.putImageData(this.history[this.historyIndex], 0, 0);

            // Update buttons and rerender
            this.updateUndoRedoButtons();
            this.renderCanvas();
        }
    }

    clear() {
        // Save state before clearing
        this.saveToHistory();

        // Clear canvas with full transparency
        this.ctx.setTransform(1, 0, 0, 1, 0, 0);
        this.ctx.clearRect(0, 0, this.canvas.width, this.canvas.height);

        // Reapply zoom
        this.renderCanvas();
    }

    getCurrentTexture() {
        // Save current state
        this.ctx.save();

        // Reset transform to get the actual image data
        this.ctx.setTransform(1, 0, 0, 1, 0, 0);

        // Make sure to use PNG format to preserve transparency
        const dataURL = this.canvas.toDataURL('image/png');

        // Restore transform
        this.ctx.restore();

        return dataURL;
    }

    saveTexture(data) {
        document.body.dispatchEvent(new CustomEvent('saveTexture', {
            detail: { data: data, propertyName: 'image' },
        }));
    }

    handleImageUpload(event) {
        const file = event.target.files[0];
        if (!file) return;

        const reader = new FileReader();
        reader.onload = (e) => {
            const img = new Image();
            img.onload = () => {
                // Set canvas dimensions to match image dimensions
                this.imageWidth = img.width;
                this.imageHeight = img.height;
                this.canvas.width = this.imageWidth;
                this.canvas.height = this.imageHeight;

                // Update dimensions display
                this.updateDimensionsDisplay();

                // Clear canvas
                this.ctx.setTransform(1, 0, 0, 1, 0, 0);
                this.ctx.clearRect(0, 0, this.canvas.width, this.canvas.height);

                // Draw image on canvas - this will preserve transparency
                this.ctx.drawImage(img, 0, 0, this.imageWidth, this.imageHeight);

                // Show canvas
                document.getElementById('noTextureMessage').style.display = 'none';
                this.canvas.style.display = 'block';

                // Reset zoom
                this.resetZoom();

                // Save state to history
                this.saveToHistory();

                // Render canvas with zoom
                this.renderCanvas();
            };
            img.src = e.target.result;
        };
        reader.readAsDataURL(file);
    }
}

terrainMapEditor.script:
class TerrainMapEditor {
    constructor(gameEditor, config = {}, { TileMap, TerrainImageProcessor, CoordinateTranslator, ImageManager, ShapeFactory }) {
        this.gameEditor = gameEditor;
        this.engineClasses = { TileMap, TerrainImageProcessor, CoordinateTranslator, ImageManager, ShapeFactory };
        this.defaultConfig = { gridSize: 48, imageSize: 128, canvasWidth: 1536, canvasHeight: 768 };
        this.config = { ...this.defaultConfig, ...config };
    
        this.defaultMapSize = 16;
        this.mapSize = this.defaultMapSize;
        this.currentTerrainId = 3; // Default to grass (index 3)
        this.isMouseDown = false;
        this.objectData = {};
        // Terrain map structure without explicit IDs
        this.tileMap = {
            size: 16,
            terrainBGColor: "#7aad7b",
            terrainTypes: [
                { type: "start", color: "#ffff00", image: [] },
                { type: "end", color: "#ff0000", image: [] },
                { type: "path", color: "#eeae9e", image: [] },
                { type: "grass", color: "#7aad7b", image: [] },
                { type: "water", color: "#64b5f6", image: [] },
                { type: "rock", color: "#9e9e9e", image: [] }
            ],
            terrainMap: []
        };
        this.environmentObjects = this.tileMap.environmentObjects || [];
        this.selectedEnvironmentType = null;
        this.selectedEnvironmentItem = null;
        this.placementMode = 'terrain'; // can be 'terrain' or 'environment'
        this.worldObjects = [];
        this.terrainTypesContainer = null;
        this.draggedItem = null;
        this.dragOverItem = null; // Track the item being dragged over

        // DOM elements
        this.canvasEl = document.getElementById('grid');
        this.canvasEl.width = this.config.canvasWidth;
        this.canvasEl.height = this.config.canvasHeight;

        // Preview elements for cursor
        this.previewCanvas = null;
        this.currentPreviewImage = null;

        // Managers and renderers
        let palette = this.gameEditor.getPalette();
        this.imageManager = new this.engineClasses.ImageManager(this.gameEditor,  { imageSize: this.config.imageSize, palette: palette}, {ShapeFactory: ShapeFactory});
        this.mapRenderer = null;
        this.mapManager = null;

        this.translator = new this.engineClasses.CoordinateTranslator(this.config, this.tileMap.size, this.gameEditor.getCollections().configs.game.isIsometric);
        this.terrainCanvasBuffer = document.createElement('canvas');
        this.terrainCanvasBuffer.width = this.tileMap.size * this.gameEditor.getCollections().configs.game.gridSize;
        this.terrainCanvasBuffer.height =  this.tileMap.size * this.gameEditor.getCollections().configs.game.gridSize;
        this.modalId = 'modal-addTerrainType';
        // Bind methods to maintain correct context
        this.init();
    }

    init() {
        this.setupTerrainTypesUI();
        this.setupTerrainImageProcessor();
        this.setupEnvironmentPanel();
        this.createPreviewCanvas();
        this.setupEventListeners();
        this.updateTerrainStyles();
    }

    setupEventListeners() {

        document.getElementById('terrainColor').addEventListener('change', (el) => {                    
            document.getElementById('terrainColorText').value = el.target.value;
        });
        document.getElementById('terrainTexture').addEventListener('change', (ev) => {
            const textureName = ev.target.value;
            if (textureName) {
                this.tileMap.terrainTypes[this.currentTerrainId].texture = textureName;
                this.terrainImageProcessor.processImage(this.gameEditor.getCollections().textures[textureName].image);
            }
        });
        document.getElementById('terrainMapSize').addEventListener('change', (ev) => {    
            const newGridSize = parseInt(ev.target.value);
            const oldGridSize = this.tileMap.size;
            
            // Create a new map to hold the resized terrain
            const newTerrainMap = [];
            for (let i = 0; i < newGridSize; i++) {
                newTerrainMap.push(new Array(newGridSize));
            }
            
            // Calculate offsets for maintaining center
            const oldOffset = Math.floor(oldGridSize / 2);
            const newOffset = Math.floor(newGridSize / 2);
            
            // Fill the new map
            for (let newI = 0; newI < newGridSize; newI++) {
                for (let newJ = 0; newJ < newGridSize; newJ++) {
                    const absI = newI - newOffset;
                    const absJ = newJ - newOffset;
                    
                    const oldI = absI + oldOffset;
                    const oldJ = absJ + oldOffset;
                    
                    if (oldI >= 0 && oldI < oldGridSize && oldJ >= 0 && oldJ < oldGridSize) {
                        // Copy existing terrain
                        newTerrainMap[newI][newJ] = this.tileMap.terrainMap[oldI][oldJ];
                    } else {
                        // Use nearest edge value for new areas
                        const clampedI = Math.max(0, Math.min(oldGridSize - 1, oldI));
                        const clampedJ = Math.max(0, Math.min(oldGridSize - 1, oldJ));
                        newTerrainMap[newI][newJ] = this.tileMap.terrainMap[clampedI][clampedJ];
                    }
                }
            }
            
            // Update tileMap with new terrain
            this.tileMap.terrainMap = newTerrainMap;
            this.tileMap.size = newGridSize;
            this.translator = new this.engineClasses.CoordinateTranslator(this.config, newGridSize, this.gameEditor.getCollections().configs.game.isIsometric);
            
            this.updateTerrainStyles();
            this.setupTerrainTypesUI();
            this.initGridCanvas();
            this.exportMap();
        });
        document.getElementById('extensionTerrainType').addEventListener('change', (ev) => {    
            const newTerrainType = parseInt(ev.target.value);            
            this.tileMap.extensionTerrainType = newTerrainType;
            this.initGridCanvas();
            this.exportMap();
        });
       
        // Handle mouseup event (stop dragging)
        document.addEventListener('mouseup', () => {
            this.isMouseDown = false;
        });

        // Add mouse down event for canvas
        this.canvasEl.addEventListener('mousedown', (e) => {
            if (e.button === 0) { // Left click
                if (this.deleteMode && this.tileMap.environmentObjects) {
                    this.deleteEnvironmentObjectAt(e);
                } else {
                    this.isMouseDown = true;
                    this.handleCanvasInteraction(e);
                }
            }
        });
        
        // Add mouse move event for drawing while dragging
        this.canvasEl.addEventListener('mousemove', (e) => {
            this.updatePreviewPosition(e);
            
            if (this.isMouseDown) {
                this.handleCanvasInteraction(e);
            }
        });

        // Add translation event listeners
        document.getElementById('translate-left').addEventListener('click', () => this.translateMap(-1, 0));
        document.getElementById('translate-right').addEventListener('click', () => this.translateMap(1, 0));
        document.getElementById('translate-up').addEventListener('click', () => this.translateMap(0, -1));
        document.getElementById('translate-down').addEventListener('click', () => this.translateMap(0, 1));

        // Handle editTileMap event
        document.body.addEventListener('editTileMap', async (event) => {
            this.config = event.detail.config;
            this.tileMap = event.detail.data;
            this.objectData = event.detail.objectData;
            this.savePropertyName = event.detail.propertyName;
            const world = this.objectData.world ? this.gameEditor.getCollections().worlds[this.objectData.world] : null;
            this.worldObjects = {};
            if(world){
                const worldObjectNames = world.worldObjects || [];             
                worldObjectNames.forEach((objectName) => {
                    this.worldObjects[objectName] = this.gameEditor.getCollections().worldObjects[objectName];
                });
            }
            this.canvasEl.width = this.config.canvasWidth;
            this.canvasEl.height = this.config.canvasHeight;            
            //this.gameEditor.setColorValue(document.getElementById('terrainBGColorContainer'), this.tileMap.terrainBGColor || "#7aad7b"); 
            if(this.tileMap.extensionTerrainType){
                this.canvasEl.backgroundColor = this.tileMap.terrainTypes[this.tileMap.extensionTerrainType].color;
            } else {
                this.canvasEl.backgroundColor = this.tileMap.terrainTypes[4].color;
                this.tileMap.extensionTerrainType = 4; // Default to grass if not set
            }

            if (!this.tileMap.environmentObjects) {
                this.tileMap.environmentObjects = [];
            }
            const extensionTerrainTypeSelector = document.getElementById('extensionTerrainType');
            // Strip id from terrainTypes if present, assume order is correct
            this.tileMap.terrainTypes.forEach((terrain, index) => {
                const newOption = document.createElement('option');
                newOption.value = index;
                newOption.textContent = terrain.type;
                if (index === this.tileMap.extensionTerrainType) {
                    newOption.selected = true;
                }
                extensionTerrainTypeSelector.appendChild(newOption);
            });
        
            // No need to remap terrainMap; assume it already uses indices matching the order
            // If terrainMap has invalid indices, clamp them to valid range
            if (this.tileMap.terrainMap && this.tileMap.terrainMap.length > 0) {
                const maxIndex = this.tileMap.terrainTypes.length - 1;
                for (let y = 0; y < this.tileMap.terrainMap.length; y++) {
                    for (let x = 0; x < this.tileMap.terrainMap[y].length; x++) {
                        const currentValue = this.tileMap.terrainMap[y][x];
                        if (currentValue > maxIndex || currentValue < 0) {
                            this.tileMap.terrainMap[y][x] = 0; // Clamp invalid values to 0
                        }
                    }
                }
            }
            
            // Update grid size if it's different
            if (this.tileMap.size && this.tileMap.size !== this.mapSize) {
                this.mapSize = this.tileMap.size;
                this.translator = new this.engineClasses.CoordinateTranslator(this.config, this.mapSize, this.gameEditor.getCollections().configs.game.isIsometric);
            } else {
                this.mapSize = this.defaultMapSize;
                this.translator = new this.engineClasses.CoordinateTranslator(this.config, this.mapSize, this.gameEditor.getCollections().configs.game.isIsometric);
            }
            
            document.getElementById('terrainMapSize').value = this.mapSize;
            requestAnimationFrame(() => {
                // Load terrain types if provided
                this.updateTerrainStyles();
                this.setupTerrainTypesUI();
                this.initGridCanvas();
            });
        });

        document.getElementById('terrainsBtn').addEventListener('click', () => {
            document.getElementById('terrainsBtn').classList.add('active');
            document.getElementById('environmentBtn').classList.remove('active');
            
            document.getElementById('terrainsPanel').style.display = 'block';
            document.getElementById('environmentPanel').style.display = 'none';
            this.placementMode = 'terrain';
            this.previewCanvas.style.display = 'none';
            // Update placement indicator
            this.placementModeIndicator.textContent = 'Placement Mode: Terrain';
            this.placementModeIndicator.style.opacity = '1';
            
            // Hide indicator after a delay
            clearTimeout(this.indicatorTimeout);
            this.indicatorTimeout = setTimeout(() => {
                this.placementModeIndicator.style.opacity = '0';
            }, 2000);
        });
        
        document.getElementById('environmentBtn').addEventListener('click', () => {
            document.getElementById('terrainsBtn').classList.remove('active');
            document.getElementById('environmentBtn').classList.add('active');
            document.getElementById('terrainsPanel').style.display = 'none';
            document.getElementById('environmentPanel').style.display = 'block';
            this.placementMode = 'environment';
            
            // Make sure environment panel is set up
            this.setupEnvironmentPanel();
            this.placementModeIndicator.textContent = 'Placement Mode: Environment';
            this.placementModeIndicator.style.opacity = '1';
            
            // Hide indicator after a delay
            clearTimeout(this.indicatorTimeout);
            this.indicatorTimeout = setTimeout(() => {
                this.placementModeIndicator.style.opacity = '0';
            }, 2000);
        });
        this.canvasEl.addEventListener('contextmenu', (e) => {
            e.preventDefault(); // Prevent default context menu
            
            if (this.placementMode === 'environment' && this.tileMap.environmentObjects) {
                this.deleteEnvironmentObjectAt(e);
            }
        });
    }

    async initImageManager() {
        let palette = this.gameEditor.getPalette();
        this.imageManager = new this.engineClasses.ImageManager(this.gameEditor, { imageSize: this.config.imageSize, palette: palette}, {ShapeFactory: this.engineClasses.ShapeFactory});
        await this.imageManager.loadImages("levels", { level: { tileMap: this.tileMap } }, false, false);
        if(this.worldObjects){
            await this.imageManager.loadImages("environment", this.worldObjects, false, false);
        }
        const terrainImages = this.imageManager.getImages("levels", "level");

        this.terrainTileMapper = this.gameEditor.editorModuleInstances.TileMap;
        if(!this.terrainCanvasBuffer) {
            this.terrainCanvasBuffer = document.createElement('canvas');
        }
        this.terrainCanvasBuffer.width = this.tileMap.size * this.gameEditor.getCollections().configs.game.gridSize;
        this.terrainCanvasBuffer.height =  this.tileMap.size * this.gameEditor.getCollections().configs.game.gridSize;

        this.terrainTileMapper.init(this.terrainCanvasBuffer, this.gameEditor.getCollections().configs.game.gridSize, terrainImages, this.gameEditor.getCollections().configs.game.isIsometric);
        this.game = { state: {}, terrainTileMapper: this.terrainTileMapper, getCollections: this.gameEditor.getCollections.bind(this.gameEditor), translator: this.translator };

        this.mapRenderer = new (this.gameEditor.scriptContext.getRenderer("MapRenderer"))(this.game, null);
        this.mapRenderer.init({ 
                gameConfig: this.config, 
                terrainCanvasBuffer: this.terrainCanvasBuffer, 
                canvasBuffer: this.canvasEl, 
                environment: this.worldObjects, 
                imageManager: this.imageManager, 
                levelName: 'level', 
                level: { tileMap: this.tileMap },
                isEditor: true,
                palette: palette
            });
    }
    updatePreviewImage() {
        if (!this.selectedEnvironmentType || this.selectedEnvironmentItem === null) {
            this.currentPreviewImage = null;
            return;
        }
        
        const images = this.imageManager.getImages("environment", this.selectedEnvironmentType);
        if (!images || !images.idle || !images.idle[0] || !images.idle[0][this.selectedEnvironmentItem]) {
            this.currentPreviewImage = null;
            return;
        }
        
        const image = images.idle[0][this.selectedEnvironmentItem];
        this.currentPreviewImage = image;
        
        // Resize preview canvas if needed
        const maxDimension = Math.max(image.width, image.height);
        const scale = this.config.imageSize / maxDimension;
        
        this.previewCanvas.width = image.width * scale;
        this.previewCanvas.height = image.height * scale;
        
        const ctx = this.previewCanvas.getContext('2d');
        ctx.clearRect(0, 0, this.previewCanvas.width, this.previewCanvas.height);
        ctx.drawImage(image, 0, 0, this.previewCanvas.width, this.previewCanvas.height);
    }
    updatePreviewPosition(e) {
        if (this.placementMode !== 'environment' || 
            !this.selectedEnvironmentType || 
            this.selectedEnvironmentItem === null || 
            this.deleteMode || 
            !this.currentPreviewImage) {
            this.previewCanvas.style.display = 'none';
            return;
        }
        
        // Get mouse position relative to canvas
        const rect = this.canvasEl.getBoundingClientRect();
        let mouseX = e.clientX - rect.left;
        const mouseY = e.clientY - rect.top;
        
        if (!this.gameEditor.getCollections().configs.game.isIsometric) {
            mouseX -= (this.canvasEl.width - this.mapSize * this.config.gridSize) / 2;
        }
        
        // For isometric view, we need to convert cursor position to actual object position
        let posX, posY;
        if (this.gameEditor.getCollections().configs.game.isIsometric) {
            const isoPos = { x: mouseX, y: mouseY };
            const pixelPos = this.translator.isoToPixel(isoPos.x, isoPos.y);
            
            // Convert back to screen coordinates
            const screenPos = this.translator.pixelToIso(pixelPos.x, pixelPos.y);
            posX = screenPos.x + rect.left;
            posY = screenPos.y + rect.top;
        } else {
            // For non-isometric, just use the mouse position
            posX = e.clientX;
            posY = e.clientY;
        }
        posX = e.clientX;
        posY = e.clientY;
        // Center the preview on the cursor
        this.previewCanvas.style.transform = `translate(${posX - this.previewCanvas.width / 2}px, ${posY - this.previewCanvas.height / 2}px)`;
        this.previewCanvas.style.display = 'block';
    }
